"1 NOTE {lineage: {father: 4, mother: 4},",
"2 CONT }",
"2 CONT ",
"2 CONT The US Census for 1850 and 1860 shows Elizabeth Ann Gobble as the daughter of William Gobble and Martha Gobble and residing in Floyd, KY. ",
"2 CONT ",
"2 CONT These censii also show Eliza born about 1843, father William about 1820, and mother Martha about 1822, all which are consistent.",
"2 CONT ",
"2 CONT Mother Martha's husband, William Gobble, is the son of Jacob Gobble and Kitty Ward, *grandson* of Christopher Gobble and Sarah Gise, born around 1820 as mentioned in the \"386 Christian Gobble\" source.",
"2 CONT ",
"2 CONT The same source mentions a William Goble born in 1800 and married to Edith Phelps born 1805.  This is the *son* of Christopher and Sarah, and the *uncle* of our direct ancestor William. They ALSO moved to KY before 1840 and then to MN in Aug 1866.",
