"2 CONT - \"Bevins, William has 1 service index card  for \"Co Morrow's , Lindsay's Reg't Tenn. Mtd. Vols.\" and 1 card for \"Callaways Mtd Detachment, Florida Mil. (4 months, 1836) Florida War\". There are also cards for John, James, and Theodore Bevins.",
"2 CONT [Our subject WLB would have been 21 years of age, and still in England in 1836.]",
"2 CONT ",
"2 CONT - A \"Bevins, William\" is listed as a Confederate prisoner of war in Saline Co, AR, from 12 Mar 1964 - 11 May 1964. (Our subject WLB would have been 49 years old, his son WAB would have been 21.)",
"2 CONT ",
"2 CONT - A \"William Bevins\" is listed as an enlisted Confederate Private in Company F of Swann's Battn Cavalry of Virginia in the Index to Compiled Confederate Military Service Records.",
"2 CONT ",
"2 CONT - A \"William Bevins\" is listed as a Union private in Company F of the 8th Regiment, Indiana Cavalry.",
"2 CONT ",
"2 CONT - Another \"Bevins, William\" appears much earlier with an enlistment date of 25 June 1815 in the \"Muster Roll of Detachment of Officers, Non-Commissioned Officers, Music, and Privates of the Unites States Marines stationed at Charlestown, MA under t",
"2 CONC he Command of William H Thornton for the Month of June 1818.\"",
