"2 CONT ",
"2 CONT 1a - Birth 1848 was in England according to all US Census reports.",
"2 CONT ",
"2 CONT 1b - The GRO Vol 10 p 179 has a birth record for Mary Ann White (mothers name Oliver) in 1st Qtr 1847 at Newton Abbot, Devon.",
"2 CONT ",
"2 CONT 2 - Birth was in 1848 or 1849 in Devon according to the English 1851 and 1861 Census, which also lists:",
"2 CONT father: Thomas White (age 24, 31)",
"2 CONT mother: Jane (Oliver?) White (age 25, 32)",
"2 CONT children: Thomas (5, 14), Mary (12, 3), Robert (11, 2), George (6 mos, 9), Gellias (na, 8), Alfred (na, 6), and Eade(na, 3).  SEE LISTING BELOW",
"2 CONT ",
"2 CONT 3 - The English 1851 Census also lists Mary Oliver, age 64 as a household member, probably Jane's mother.",
"2 CONT ",
"2 CONT 4 - Immigrated to US in either 1873 (per 1900 Census) or in 1871 (per 1910 Census)",
"2 CONT ",
"2 CONT 5 - The English 1871 Census also has a Mary White in the household of a Thomas White.  BUT, she is age 15, born 1856 in Manchester, to father Thomas White (age 41, OK) and mother Mary Ann White (age 38, not OK), with",
"2 CONT children Elizabeth (19), Mary Ann (15), John (9), ",
"2 CONT Louisa (7), and Sarah Ellen (5).",
"2 CONT ",
"2 CONT So the 1871 census record must be for a different Thomas White of the same age, but with a wife Mary Ann and a child Mary Ann of the wrong age.",
"2 CONT ",
"2 CONT That is also approximately when Mary Ann immigrated to US (1871 or 1873); did something happen to her mother or to the family?",
"2 CONT ",
"2 CONT 1851 England Census:",
