"1 NOTE 1. William Gobble (#BH42), born about 1820, is the son of Jacob Gobble (#BH84) and Kitty Ward (#BH85), and the GRANDSON of Christopher Gobble (#BH168) and Sarah Gise as stated in the \"386 Christian Gobble\" source.  He was married to Martha Amy Harr",
"2 CONC is (#BH43).",
"2 CONT ",
"2 CONT The same source mentions another William Gobble born in 1800 and was married to Edith Phelps.  This is the UNCLE of our direct ancestor William Gobble (#BH42). They ALSO moved to KY before 1840 and then to MN in Aug 1866.",
"2 CONT ",
"2 CONT 2. See son George Washington Gobble's photo gallery for a statement that William Gobble served with the Confederate Army.",
