"1 NOTE 1. Born in 1796, this John Sowders (#BH46) would have been 64 at the outbreak of the Civil War.  Furthermore, if he died in 1858 he certainly wasn't in the war.",
"2 CONT ",
"2 CONT Since John (#BH46) and his wife Elizabeth were both born and/or resided and died in Illinois, where their daughter Elizabeth Ann was known to be born, they are likely the correct parents of Elizabeth Ann (#BH23).",
"2 CONT ",
"2 CONT 2. There was a John W Sowders who was a private in Companies A &amp;amp; F of the 4th Reg Illinois Cavalry.   This may have been their son John, who was born in 1823.",
"2 CONT ",
"2 CONT There was also a John Sauder who served in Company G of the 2nd West VA Cavalry and had a widow named Elizabeth Souders.",
"2 CONT ",
"2 CONT 3. The Sowders Family manuscripts state that John Prillaman Sowders, the son of Anna Prillaman and Jacob Sowders, was was born 4 Oct 1803 in Franklin Co, VA, and married a woman named Cynthia Craig in Montgomery Co, VA. on 4 Sep 1830.  So the wives",
"2 CONC ' names do not match up, unless John Sowders married a second time.",
"2 CONT ",
"2 CONT THEREFORE, it looks like Jacob Sowders and Anna Prillaman may NOT BE the parents of John WIlliam Sowders (#BH46).",
"2 CONT I have unlinked them, but they remain in the data tree.",
"2 CONT ",
"2 CONT 4 The marriage date is also suspicious: John would have been 16 and Elizabeth 17.",
