"2 CONT ",
"2 CONT The 1880 USFC has the Lemler children Mary (17, b abt 1863), William (15, about 1865), Elizabeth (13, abt 1867), Emma Matilda (12, abt 1868), and Anthia (9, abt 1871) all living with Horace and Amanda Pownell.",
"2 CONT ",
"2 CONT Nicholas Lemler died in 1873, so these underage children were apparently living with the Pownells.  The older children, Daniel David (23, 1857), Loany (21, 1859), and Celina, had apparently moved out on their own.",
"2 CONT ",
"2 CONT Nicholas' wife, Amanda Hartsel, was born in 1835, and would have been 45 in 1880.  An Amanda Pownell is listed as 40 in 1880, so she may have remarried to Horace Pownell.",
