"1 _DSCR Bio for Oliver B Spears (O.B.) but includes info about his father Spencer Spears Jr. (Jr. was son of Spencer Sr. and Tabitha Chaffin).  When Tabithat moved the family to Ohio (along way Spear sr. died), she got involved in tobacco farming",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: small;\"&gt;http://www.heritagepursuit.com/Brown/Brown1883S2P150.htm&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;br&gt;&lt;span style=\"font-size: small;\"&gt;O.[Oliver] B. SPEARS, to",
"2 CONC bacconist, Aberdeen (Brown County, Ohio]. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: small;\"&gt;In the year 1879, Mr. Spears located in Aberdeen [Ohio} and engaged in the tobacco trade, and has since dealt largely in th",
"2 CONC e article. During the three years he has been engaged, he has purchased on an average about 125,000 pounds per annum. For five years previous to his coming to Aberdeen, he was engaged in the same business, handling in the meantime large quantities",
"2 CONC . He was born in Brown County, Ohio, in 1849, and is a son of Spencer Spears [and mother Tabitha CHAFFIN Young Spears], whose sketch appears in the history of Union Township. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: s",
"2 CONC mall;\"&gt;The boyhood of our subject was spent on the farm till he attained his majority, at which time he began handling tobacco. He is a member of the Gretna Green Lodge, No. 99, K. P., to which he has been connected some yea's, and is an honore",
"2 CONC d and worthy member.&lt;/span&gt;&lt;/p&gt;</line></content></metadataxml>",
