"1 _META <metadataxml><content><line>&lt;p&gt;Cynthia&amp;#39;s story is not commonly known. At the time she married Christopher Collins she was 17 or 18 years old and had a 3 or 4 year old son (Thomas Whitt Spears). After the birth of this child a court he",
"2 CONC aring was held in an effort to get Cynthia to reveal the name of the father. In such a time in history, fathers were forced to provide for illegitimate children so as not to burden the community, Cynthia refused all pleas and took the secret to th",
"2 CONC e grave with her.&lt;/p&gt;&lt;p&gt;In 1832 Christopher married Cynthia and Thomas Whitt Spears, at last, had a father.&lt;/p&gt;</line></content></metadataxml>",
