"2 CONC le=\"box-sizing: border-box; --line-clamp: 5;\"&gt;Francis died 1702 intestate in Christiana Hundred, New Castle County, Delaware. Letters of administration were granted 20 Nov 1702 to his widow Cicely by the Register General in Philadelphia (PGM 19:",
"2 CONC 276). Cicely lived out her widowhood at the mill, operating it in conjunction with her sons and probably others. She appears alive in 1723 when Jeremiah Collett, of Chichester, is recorded as having lands bounded by lands of Cecily Baldwin, Roger J",
"2 CONC ackson, John Grub, Jonah Sanderland, etc. (Abstract of General Land Office dated 5th Mo. 22, 1723 [22 July 1723]). According to Thomas Coeburn's Will, Francis and Cecily had a son William and four other unnamed children befoe March 1697. A Calenda",
"2 CONC r of Delaware Wills, New Castle County, 1682-1800. New York, NY: National Society of the Colonial Dames of America, 1911; Baltimore, Maryland: Genealogical Publishing Company, 1969.&lt;/div&gt;</line><line>&lt;/div&gt;</line><line>&lt;/div&gt;</lin",
