"2 CONC ox-sizing: inherit; color: #1f497d; font-family: calibri, sans-serif; font-size: 11pt;\"&gt;Thomas and Ruth were both born in Virginia and were in Floyd County, Kentucky by 1810. Thomas died between 1840 (on census) and 1850 (not on census). Ruth di",
"2 CONC ed between 1860 (on census) and 1870 (not on census) in Floyd County, Kentucky.&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: inherit; margin-: 0px; margin-bottom: 0px; padding: 0px; color: #4e453f; font-family: 'sourc",
"2 CONC e sans pro', 'helvetica neue', arial, sans-serif; font-size: 16px;\"&gt;&lt;strong&gt;&lt;span style=\"box-sizing: inherit; color: #1f497d; font-family: calibri, sans-serif; font-size: 11pt;\"&gt;&lt;span style=\"font-size: 11pt;\"&gt;Ruth would have be",
"2 CONC en 20 in 1810 and Thomas between 16 and 25. &lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: inherit; margin-: 0px; margin-bottom: 0px; padding: 0px; color: #4e453f; font-family: 'source sans pro', 'helvetic",
"2 CONC a neue', arial, sans-serif; font-size: 16px;\"&gt;&lt;strong&gt;&lt;span style=\"box-sizing: inherit; color: #1f497d; font-family: calibri, sans-serif; font-size: 11pt;\"&gt;&lt;span style=\"font-size: 11pt;\"&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nb",
"2 CONC sp; They had two children (both sons; forenames unknown) on the 1810 census when &amp;nbsp;both Ruth and Thomas are listed as between 16 and 25 years old.&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: inher",
"2 CONC it; margin-: 0px; margin-bottom: 0px; padding: 0px; color: #4e453f; font-family: 'source sans pro', 'helvetica neue', arial, sans-serif; font-size: 16px;\"&gt;&lt;strong&gt;&lt;span style=\"box-sizing: inherit; color: #1f497d; font-family: calibri, s",
"2 CONC ans-serif; font-size: 11pt;\"&gt;There are three documented children on census records.for Ruth &amp;amp; spouse, Thomas Spears.&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: inherit; margin-: 0px; margin-bottom: 0px; pa",
"2 CONC dding: 0px; color: #4e453f; font-family: 'source sans pro', 'helvetica neue', arial, sans-serif; font-size: 16px;\"&gt;&lt;strong&gt;&lt;span style=\"box-sizing: inherit; color: #1f497d; font-family: calibri, sans-serif; font-size: 11pt;\"&gt;1. Samue",
"2 CONC l, the son who was head of the household in 1850 &amp;amp; 1860. Samuel was born abt 1828;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: inherit; margin-: 0px; margin-bottom: 0px; padding: 0px; color: #4e453f; font-fami",
