"2 CONC h Samuel and then Samuel&amp;rsquo;s son. Abrahan was born abt 1830;.&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: inherit; margin-: 0px; margin-bottom: 0px; padding: 0px; color: #4e453f; font-family: 'source sans pro'",
"2 CONC , 'helvetica neue', arial, sans-serif; font-size: 16px;\"&gt;&lt;strong&gt;&lt;span style=\"box-sizing: inherit; color: #1f497d; font-family: calibri, sans-serif; font-size: 11pt;\"&gt;3. Frances J., a daughter born abt 1834.&amp;nbsp;&lt;/span&gt;&lt",
"2 CONC ;/strong&gt;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: inherit; margin-: 10px; margin-bottom: 0px; padding: 0px; color: #4e453f; font-family: 'source sans pro', 'helvetica neue', arial, sans-serif; font-size: 16px;\"&gt;&lt;strong&gt;&lt;span s",
