"2 CONC p;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Matthew Hanan, Sergeant&amp;nbsp;&lt;br&gt;The names of fifty-two or more privates make up the list. And the following names are given of men who &amp;quot;also served tours with Catptain Guthery&amp;quot;...",
"2 CONC ..................&amp;nbsp;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Samuel Swindler&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;&lt;fon",
