"2 CONC ize=\"3\"&gt;We also learn from &amp;quot;Revolutionary Soldiers Buried in Ohio&amp;quot;, p. 167 that he was a Captain of this company from 1780 to 1790 and did further service in 1793. According to Mr. Howard Leckey, Sr., he was Lieutenant-Colone",
"2 CONC l of the 1st Regiment Pennsylvania Militia of Washington County in Anthony Wayne&amp;#39;s campaign. His sons William and Archibald fought under him there. This account also states that Captain John Guthery was born on April 14, 1744. In his pensio",
"2 CONC n application he says he was born of Scotch-Irish parents. The family Bible says he was born April 14, 1744. This record also says that on March 13, 1771 he married Lydia Baldwin. She was the daughter of Francis and Charity (Harlan-Hackney) Baldwin",
"2 CONC . The records show that Lydia Baldwin had a tract of land warranted to her under the title &amp;quot;Lydia&amp;#39;s Bottom&amp;quot; on November 1, 1770. It was situated near the mouth of Big Whiteley Creek on the Monongahela River and was patente",
"2 CONC d on April 17, 1792 by John Guthery and his wife Lydia. It was on this site that he maintained Fort Guthery from 1776-1783 and it was here they lived until they migrated to Ohio. The John Guthery-Lydia Baldwin patent contained 321 acres. Other Bald",
"2 CONC win land totaled more than 1000 acres. Deeds of record showing evidence of the sales can be seen in the Harrisburg Land Office. &amp;quot;Lydia&amp;#39;s Bottom&amp;quot; was situated adjacent to the present site of Greensboro, Pennsylvania, whic",
"2 CONC h was laid out by Elias Stone, brother-in-law of John Guthery in the year 1781. As has been previously stated it was first called Greensburg but later changed to Greensboro to avoid confusion with Greensburg of Westmoreland County, Pennsylvania.&am",
"2 CONC p;nbsp;&lt;br&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=\"font-size: 14px\"&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;In Mr. Howard L. Leckey&amp;#39;s History of the Ten Mile Country, which was in the Monongahela region o",
"2 CONC n the west side of the river and included the country drained by the Big Whiteley, the Little Whiteley, Dunkard, Muddy and Wheeling Creeks, he says two churches were built; one at Gerrard&amp;#39;s Fort, the other at Jacob Van Meter&amp;#39;s plant",
"2 CONC ation on Muddy Creek. The Reverend Mr. John Corbly preached at both churches twice a month. These were of the Baptist persuasion and were stern in their doctrines and members were willing, as in the case of the earlier Puritans, to have their live",
"2 CONC s scrutinized and judged by their fellow community members. John Guthery&amp;#39;s name, with his wife Lydia, is on this early list and may be seen with the names of their neighbors in Mr. Leckey&amp;#39;s book. They attended the church at Big Whit",
"2 CONC eley Creek as it was near their home. They spent the whole day at church, which was a day of social diversion, of setting problems right, renewing old acquaintances, airing scandals, making matches, and otherwise uplifting their spirits and settin",
"2 CONC g right the troubled experiences of the week. It was their guide and their help in time of trouble and we may envy them their source of inspiration and refreshment.&amp;nbsp;&lt;br&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=\"fon",
"2 CONC t-size: 14px\"&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;John Guthery&amp;#39;s family of eleven children were now increasing in stature; indeed some of them were already grown and he had to look to the future. So, after selling his lands in Gr",
"2 CONC eene County, Pennsylvania, by a number of deeds of record, he moved by flatboat down the Monongahela and Ohio Rivers to where Portsmouth now stands, and then up the Scioto River to his claim in what is now Pike County, Ohio. His lands are said to h",
"2 CONC ave covered several thousand acres. He later laid out the town of Piketon and was instrumental in making it the county seat; years afterward the county seat was moved to Waverly. He died June 1, 1823 and is buried in Mound Cemetery, on his origina",
"2 CONC l land. Mound Cemetery contains several Indian mounds and John Guthery, his wife and a daughter who was the mother of the famed Mother Stewart, famous Civil War nurse and Temperance reformer were laid in a brick vault in one of the mounds buried on",
"2 CONC e above the other. Across the road from the cemetery is the site of the old family home of Colonel Guthery. Some years back it was pointed out to several of his descendants by Mr. Charles Daily, another descendant, who was the village druggist at P",
"2 CONC iketon. He said sometimes they found a brick from the old house on the site, the house itself having been long demolished.&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;br&gt;THE FAMILY AND BIBLE RECORD OF JOHN AND LYDYA BALDWIN GUTHERY&amp;nbsp;&lt;br&gt;Contr",
"2 CONC ibuted by Richard H. May of Mill Valley California&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;The family Bible which belonged to John and Lidya Baldwin Guthery is in th",
"2 CONC e Public Library at Chattanooga, Tennessee, given to that library along with other books from the estate of Mrs. C. C. (Annie Rathburn) Nottingham, who died in 1939. She was a great-great-grand-daughter of John and Lidya B. Guthery. (This bible ma",
"2 CONC y be known as the Guthery-Daniels Family Bible, perhaps so named because it had been in the possession of Rebecca Guthery Daniels who was the mother of the famed Civil War nurse Eliza Daniels &amp;quot;Mother&amp;quot; Stewart) Information about th",
"2 CONC is Bible came to me through Mrs. Luther G. (Ima Gene Guthery) Boyd, of Akron, Ohio, OGS member, and Mrs. George S. (Patricia Guthery) Farmer, of Chattanooga, Tennessee. Apparently neither Mrs. Boyd nor Mrs. Farmer are descendants of John Guthery, b",
"2 CONC ut found this record in searching for their ancestors.&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;The title page from the New Testament of this Bible shows that it wa",
"2 CONC s printed in Oxford, (England) in 1768, by T. Wright and W. Gill, Printers to the University. John Guthery and Lidya Baldwin were married in 1771. They had 12 children, all born in what is now Greene County, Pennsylvania. One child died in infancy",
"2 CONC , but with the others they migrated in 1797 or 1798 to what is now Pike County, Ohio. Lidya B. Guthery died in 1816; John Guthery in 1823; both were buried in Mound Cemetery, near Piketon, Ohio. The 11 surviving children all married. Some remaine",
"2 CONC d in Pike County and died there; others moved north or west; and the descendants of at least one line moved south to Tennessee.&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nb",
