"2 CONC LDWIN&lt;/font&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;:&lt;br&gt;The following account of the Baldwin family is taken from the Baldwin Genealogy by Charles Candee Baldwin:&amp;nbsp;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbs",
"2 CONC p;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Tracing back from Lydia Baldwin&amp;#39;s father we have Francis Baldwin Sr., who it is inferred was the grand-father of Francis Baldwin Jr., but the name of Francis Baldwin&amp;#39;s father has been los",
"2 CONC t.&amp;nbsp;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Francis Baldwin Sr. came over to America from England with his two brothers, Thomas and John. They first settled, probably at Penn&a",
"2 CONC mp;#39;s Neck with other English Baptist families, according to Thomas Baldwin&amp;#39;s record, around 1653.&amp;nbsp;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;By family tradition and f",
"2 CONC ortified by a statement that Thomas was born in Oxfordshire, England we may justly conclude that this is true of Francis and John. Gilbert Cope thinks they may have been connected with the Baldwins of Buckinghamshire, wealthy yeomen of that county.",
"2 CONC &amp;nbsp;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Francis Baldwin Sr. is found an early settler in the neighborhood of West Chester County, Pennsylvania. At that time the locality wa",
"2 CONC s in Delaware County, Pennsylvania. He was there as early as 1686. That he is the brother of Thomas and John is evidenced by the will of John to sons of his brother Francis, in which he leaves five shillings each to &amp;quot;all my brother Francis",
"2 CONC &amp;#39; children&amp;quot;. The names of only two of these children are given in the will and they inherited, besides, ten pounds. Their names were Thomas and John. Which of these was the probable father of our Francis Jr. is not clear.&amp;nbsp;",
"2 CONC &lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Francis Sr.&amp;#39;s name appears in Chester County as witness to deeds in 1691, 1697, 1699 and 1700. In 1691 he received a deed of one hundre",
"2 CONC d acres from Thomas Coebourne, which lay in Chester. The consideration was an annuity. In 1692 John Maddock conveyed fifty acres in Nether Providence, &amp;quot;Nether Cutt&amp;quot;, which he purchased of Francis Baldwin. In 1695 he received a rec",
"2 CONC ord deed from Thomas Coebourne of one hundred acres in Chester, which next year he conveyed to Joseph Coebourne for fifty pounds. Letters of administration were granted August 17th, 1702 to his widow, Cicely, by the Register General at Philadelphia",
"2 CONC .&amp;nbsp;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Francis Sr. was a miller. He was juror July 19th, 1700. He died in New Castle County in 1702. His wife was Cicely Coebourne, not Colb",
"2 CONC ourne, as given in the Baldwin history and afterward corrected. Cope says he does not know the names of Francis Baldwin Jr.&amp;#39;s children. Again we turn gratefully to Mr. Leckey who supplies this loss of record of our family. They did go to Vi",
"2 CONC rginia.&amp;nbsp;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;Mr. Leckey&amp;#39;s records show that Francis Baldwin Jr. and his wife Charity (Harlan-Hackney) lived in Chester County, Penns",
"2 CONC ylvania, the same locality as Francis Baldwin Sr. lived and that in 1760 they moved to Franklin County Virginia (now Berkeley County, West Virginia), where she and her second husband are buried in the Greene Springs Meeting House Cemetery.&amp;nbsp",
"2 CONC ;&lt;br&gt;&lt;font size=\"4\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/font&gt;&amp;nbsp;&lt;br&gt;&lt;font color=\"0000C0\"&gt;Notes for&lt;/font&gt;&amp;nbsp;Joseph Hackney:&amp;nbsp;&lt;br&gt;Joseph Hackney came from England to Ame",
"2 CONC rica with his parents and settled in New Castle, Delaware. He was married in Old Swedes Church in 1731 to Charity Harlan, daughter of Aaron Harlan. Joseph Hackney died in 1745. His widow, Charity Harlan Hackney was married in 1746 to Francis Baldwi",
"2 CONC n Jr. In 1760 they moved to Frederick County, Virginia. The family were Quakers and records can be found in Hinshaw and &amp;quot;Old Hopewell&amp;quot;. Haddon&amp;#39;s History of Fayette County, Pennsylvania, also gives part of the record. (Fro",
"2 CONC m &amp;quot;The History of Lieutenant-Colonel John Guthery of Greene County Pennsylvania and of Allied Families&amp;quot; Compiled by Mary Gray May)&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;font color=\"0000C0\"&gt;Notes for&lt;/font&gt;&amp;nbsp;Francis Bal",
"2 CONC dwin, Jr. :&amp;nbsp;&lt;br&gt;The four Baldwin girls all got warrants to land to which each later received patent in joint tenancy with their respective husbands. (The above from a letter of Leckey to Mrs. Carroll H. May dated January 25, 1950.)&a",
