"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: x-large;\"&gt;&lt;span style=\"font-family: arial;\"&gt;ISAIAH W. KEIDER. Among the substantial citizens of Cass County, none are more highly respected than the above. He was born June 4",
"2 CONC , 1830, in Montgomery County, Ohio, a Sod of Henry and Susanna (Custer) Krider. The former was born in Lancaster County, Penn., July 14, 1779; the latter is also a native of Pennsylvania, born March 23, 1802. In 1837 the parents removed to Cass Cou",
"2 CONC nty, and became associated with the county and its interests. The father was a man of quiet and unpretentious habits, yet, withal, he was a man of substantial worth and merit His death occurred March 3, 1808. His widow, who still survives him, resi",
"2 CONC des in Bethlehem Township, is in her eighty-fifth year, and is remarkably active, both of body and mind. She is a descendant of Paul Custer, an English gentleman of wealth, and is admired for her qualities of true womanhood. Christian Krider, the p",
"2 CONC aternal grandfather of our subject, was a native of Pennsylvania, but left his native county in 1810, going to Erie County, where he remained until 1815, in which year he removed to Washington County, where he continued to live fourteen years; the",
"2 CONC n removed to Montgomery County, Ohio; subsequently, in 1837, he came to Cass County, and here took his share in the perils and privations, the valor and enterprise of the early pioneer days. In his eightysixth year he went from Logansport to Chicag",
"2 CONC o, thence to Peoria 111., going the entire distance on horse-back. His death occurred December 23, 1847, and his remains now rest in the Bethlehem Church-yard. Isaiah W., the immediate subject of this sketch, was the fifth child of a family of eigh",
"2 CONC t, namely: Elizabeth, George C., Christian E., David H., subject, Mary M., Rebecca and Susan, born to his parents. He removed with them to Cass County, and remained under the parental roof until twenty-four years of age. December 30, 1852, he marri",
"2 CONC ed' Martha T. Genung, a daughter of Ira and Hannah J. (Sterges) Genung, natives of New Jersey. Eleven children were the fruit of this union, viz.: Anthony A. born October 21,1853, died January 1860; Leroy M., born April 5,1855; Alice C., born Janua",
"2 CONC ry 9, 1857; Ira G., born October 7, 1858; Jay H., born January 5, 1861, died July 24, 1881; Laura A., born September 21, 1862, died October 30, 1863; Mary F., born September 26, 1864; Clarance E., born December 14, 1866, died February 17, 1867; Isa",
"2 CONC iah Wesley, born March 1, 1869; Elizabeth, born September 0, 1872, and Elda T., born February, 13, 1877. The oldest living son, Leroy M., was educated at Fort Wayne Ind., also a graduate of De Pauw University. He is a minister of ability, and is no",
"2 CONC w located at Wabash, Ind. Mr. Krider located where he now lives in 1853. and owns 193 acres of good land. He has been bard working and industrious, and what he now has is mainly the fruit of his own accumulation. He and wife are members of the Meth",
"2 CONC odist Episcopal Church&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;</line></content></metadataxml>",
