"1 _META <metadataxml><content><line>Gen 1: Patrick Collins&amp;nbsp;&lt;span style=\"font-size: small;\"&gt;(b.abt 1755 Ireland)&lt;/span&gt;&amp;nbsp;&amp;amp; Elizabeth Pepper:</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: mediu",
"2 CONC m;\"&gt;Family tradition says that Patrick and his brothers were the first to come to America from Ireland, complete with a price on each head. How much of this is true remains to be seen. In the 17th and 18th centuries, England ruled Ireland wit",
"2 CONC h a heavy hand. Pouching a rabbit on lands claimed by English gentry could bring a jail sentence, so a price on the head of an Irishman could have been anything. England often forced the Irish from their homes, pulling the houses down so the famil",
"2 CONC y who occupied the dwelling could not return. Perhaps Patrick and his family were indentured servants upon their arrival in America.&lt;/p&gt;</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"&gt;Patrick is said t",
"2 CONC o have a brother, Michael. No record of Michael could be found in western Maryland, but across the river, in Virgina, we find a record of a Michael Collins who evidently lived in an area south of present day Winchester. It remains to be seen if thi",
"2 CONC s Michael was Patrick's brother.&lt;/p&gt;</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"&gt;It is a possibility that Elizabeth Pepper was Patrick's second wife and not the mother to the two children that we kno",
"2 CONC w are Patrick's offspring: Rhesa (or Reece) and Senah. They may have been more born to Patrick, but we have not been able to discern yet just who they are.&lt;/p&gt;</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"",
"2 CONC &gt;Patrick left Frederick Co. after the 1790 census and made his way to Washington Co., Virgina. In 1798 Patrick purchased 92 acres of land on the south fork of the Holston River in Washington Co. It is assumed that by 1830 Patrick had died. He wo",
"2 CONC uld have been getting on in years. He fought in the Revolutionary war and was probably born around 1760, or before. So by 1830, Patrick would have been in his seventies, an old man by the standards of the day.&lt;/p&gt;</line><line>Gen 2. Rhesa (Re",
"2 CONC ece) Collins&amp;nbsp;&lt;span style=\"font-size: small;\"&gt;(b.abt 1775-78, Fredrick Co., Maryland d. 1830-40, Floyd Co., Kentucky)&lt;/span&gt;&amp;nbsp;&amp;amp; Mary (Brooke?):</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-",
"2 CONC size: medium;\"&gt;Rhesa, as far as can be determined, was born in Frederick Co., Maryland about 1775. Mary, too, was probably born there. Although we have not found any documentary evidence as proof, it is believed that Mary was a Brooke. In the 17",
"2 CONC 90 census of Frederick C., the father Patrick Collins and his wife, Elizabeth, were next door neighbors (or next door farmers) to a Brooke family. In the Collins family we find a number of Brooke or Brooksie Collinses, se we suspect that Mary may h",
"2 CONC ave been a Brooke. It is not had to imagine that Rhesa married the girl next door.&lt;/p&gt;</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"&gt;Sometime between the 1800 and 1810 federal census, Rhesa and Mary lef",
"2 CONC t Frederick Co. to join Patrick in Washington Co. It is believed they left Maryland after 1808 as their son, Christopher was born about 1807 in Frederick Co. In Washington Co., four children were born to Rhesa and Mary: William, Isaac, John and Sen",
"2 CONC ah&lt;/p&gt;</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"&gt;In the 1820 census Patrick, Rhesa, William, Isaac, Samuel an John are listed as living next door to each other so we assume they all farmed the lan",
"2 CONC d Patrick bought on Holston. We can only speculate upon the relationship of these men. Were William, Isaac, Samuel, and John also sons of Patrick? Or were they brothers to Patrick? We only know that Rhesa was a son and that he and Mary named thre",
"2 CONC e of their sons Isaac, William, and John. The other son was a Christopher. In this family, for generations, the habit was to name newly born children after aunts, uncles, grandparents and historical figures. We can safely assume that Isaac, Willia",
"2 CONC m and John were named after family members. We just don't know what the relationship was.&lt;/p&gt;</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"&gt;Sometime before 1830 the decision was made to move to Floyd Co",
"2 CONC ., Kentucky where land was purchased on John's Creek. By that time Rhesa and Mary were advancing in years. By 1830, Rhesa would have bee about 55. By the 1840 census Rhesa is no longer listed, only Mary, so we know he died sometime between 1830 an",
"2 CONC d 1840.&lt;/p&gt;</line><line>Senah Collins&amp;nbsp;&lt;span style=\"font-size: small;\"&gt;(b.21 Feb 1781, Fredrick Co., Maryland d.22 Oct 1822, Fredrick Co., Maryland)&lt;/span&gt;&amp;nbsp;&amp;amp; Daniel Albaugh:</line><line>&lt;p style=\"font-f",
"2 CONC amily: arial, arial, helvetica; font-size: medium;\"&gt;Back in Frederick Co. Rhesa's sister, Senah married Daniel Albaugh and remained in Maryland. Rhesa and Mary had a daughter whom they named for Senah Collins Albaugh. Once Patrick and the other",
"2 CONC s abandoned Frederick Co., Maryland for greener pastures in Washington Co, Virgina, Senah likely never saw her family again. Many of the descendants of Senah and Daniel still live in the Frederick Co., Maryland area.&lt;/p&gt;</line><line>Gen 3. Ch",
"2 CONC ristopher Collins&amp;nbsp;&lt;span style=\"font-size: small;\"&gt;(b.abt 1807, Fredrick Co., Maryland d. 1860-80, Johnson Co., Kentucky)&lt;/span&gt;&amp;nbsp;&amp;amp; Cynthia Spears&amp;nbsp;&lt;span style=\"font-size: small;\"&gt;(b.1816 John's Cre",
"2 CONC ek, Floyd Co., Kentucky d.1870-80, Johnson Co., Kentucky)&lt;/span&gt;:</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"&gt;Christopher is considered to be the progenitor of most, if not all, of the Collinses who s",
"2 CONC ettled in the Daniel's Creek and John's Creek areas of Kentucky.&amp;nbsp; Christopher is recorded as having bought land on John's Creek in the early 1830's, prior to his marriage to Cynthia Spears.&lt;/p&gt;</line><line>&lt;p style=\"font-family: a",
"2 CONC rial, arial, helvetica; font-size: medium;\"&gt;Cynthia's story is not commonly known. At the time she married Christopher Collins she was 17 or 18 years old and had a 3 or 4 year old son (Thomas Whitt Spears). After the birth of this child a cour",
"2 CONC t hearing was held in an effort to get Cynthia to reveal the name of the father. In such a time in history, fathers were forced to provide for illegitimate children so as not to burden the community, Cynthia refused all pleas and took the secret t",
"2 CONC o the grave with her.&lt;/p&gt;</line><line>&lt;p style=\"font-family: arial, arial, helvetica; font-size: medium;\"&gt;In 1832 Christopher married Cynthia and Thomas Whitt Spears, at last, had a father.&lt;/p&gt;</line></content></metadataxml>",
