"1 _META <metadataxml><content><line>&lt;p style=\"margin: 0in 0in 0pt;\"&gt;&lt;span style=\"font-family: 'arial','sans-serif'; font-size: 10pt;\"&gt;Henry (my father), the youngest son, was born July 14, 1799 and died March 23, 1868 in Cass County, Indiana, w",
"2 CONC here he moved in May 1737.&lt;span style=\"mso-spacerun: yes;\"&gt;&amp;nbsp; &lt;/span&gt;He married Susanna Custer September 20, 1819.&lt;span style=\"mso-spacerun: yes;\"&gt;&amp;nbsp; &lt;/span&gt;Susanna Custer was born in Washington County, Penns",
"2 CONC ylvania March 23, 1802 and died April 12, 1887.&lt;span style=\"mso-spacerun: yes;\"&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"margin: 0in 0in 0pt;\"&gt;&lt;span style=\"font-family: 'arial','sans-serif'; font-size: 10",
"2 CONC pt;\"&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"margin: 0in 0in 0pt;\"&gt;&lt;span style=\"font-family: 'arial','sans-serif'; font-size: 10pt;\"&gt;To them were born eight children.:&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"m",
"2 CONC argin: 0in 0in 0pt;\"&gt;&lt;span style=\"font-family: 'arial','sans-serif'; font-size: 10pt;\"&gt;&lt;span style=\"mso-tab-count: 1;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt",
"2 CONC ;/span&gt;Elizabeth&lt;span style=\"mso-tab-count: 2;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&",
"2 CONC amp;nbsp;&amp;nbsp; &lt;/span&gt;b. June 28, 1821&lt;span style=\"mso-tab-count: 2;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&",
"2 CONC amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;d. August 1833&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"margin: 0in 0in 0pt;\"&gt;&lt;span style=\"font-family: 'arial','sans-serif'; font-size: 10pt;\"&gt;&lt;span style=",
"2 CONC \"mso-tab-count: 1;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;George C.&lt;span style=\"mso-tab-count: 2;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp",
"2 CONC ;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;b. November 24, 1822&lt;span style=\"mso-tab-count: 1;\"&gt;&amp;nbsp;&amp;nbsp; &lt;/span&gt;d. Aug",
"2 CONC ust 17, 1855&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"margin: 0in 0in 0pt;\"&gt;&lt;span style=\"font-family: 'arial','sans-serif'; font-size: 10pt;\"&gt;&lt;span style=\"mso-tab-count: 1;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&a",
"2 CONC mp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;Christian E.&lt;span style=\"mso-tab-count: 2;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;n",
"2 CONC bsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;b. February 24, 1825&lt;span style=\"mso-tab-count: 1;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;d. January 3, 1863&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"margin: 0i",
"2 CONC n 0in 0pt;\"&gt;&lt;span style=\"font-family: 'arial','sans-serif'; font-size: 10pt;\"&gt;&lt;span style=\"mso-tab-count: 1;\"&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt",
