"1 _OID 202cc155-058f-45f4-a8fb-6c4a28bf215f",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"color: #4e453f; font-family: 'times new roman'; font-size: medium; line-height: 23.2px;\"&gt;..John Guthery(Guthrie, Gutherie, Guthrey, Gutrey) one of the prominent pioneer settlers on the Mononga",
"2 CONC hela, settled near the mouth of the Big Whiteley Creek before 1772, where his name is found as an \"inmate\" or boarder in the Springhill Township, Bedford County tax lists for 1772. According to his pension application made from Pike County, Ohio, O",
"2 CONC ctober 13, 1820, he was living there in May 1776, when he enlisted in Captian Wilson's company (probably Lt. Col. George Wilson) of the 8th Pennsylvania Regiment of the Continental line, under the command of Colonel Angus McCoy with which he was id",
"2 CONC entified until May 1779. Records of the regiment show that it was recruited at Fort Pitt and that many of its men came from the Monongahela country. It assembled at Kittanning in the fall of 1776 and marched from there in January 1777 to join Washi",
"2 CONC ngton's army at Quibbletown, New Jersey. This march in midwinter was a terrible ordeal and many of the men died from exposure. (See Pennsylvania Archives: The 8th Pennsylvania travelled over hills for one hundred and fifty miles in the snow to Quib",
"2 CONC bletown, New Jersey, never once seeing a house on the way, but encamped in the snow. Many were unused to such conditions and died on the way; the Colonel and Lieutenant-Colonel and also Archibald Guthery Sr., who may have been brother to John Guthe",
"2 CONC ry.) After taking part in the battles of Brandywine and Germantown, the regiment went to Bound Brook, New Jersey, where it again saw battle.&lt;/span&gt;&lt;/p&gt;</line></content></metadataxml>",
