"1 PLAC Posting courtesy of Ladd Bjorneby -- laddbjorneby@@earthlink.net",
"1 _DSCR \"That crofter and miller Embret Christiansen Bjornebyequaern of Asnes Parish in Solor and his wife Ragnhild Guttormsdatter with four children intend to travel to America. Here in the Parish they have achieved a quiet and proper conduct and I recomm",
