"2 TITL Katherine &quot;Kitty&quot; Donnally",
"1 _OID 2e472bb6-ac89-4bfd-9981-a1816025240e",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;Catherine \"Kitty\" Donnally was born about 1765 - 1775 in Augusta County, Virginia.&amp;nbsp; She was the daughter of Charles Donnally, originally from North Ireland, and Ma",
"2 CONC ry Gillespie, probably also born in Ireland.&amp;nbsp; &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;Her parents were among the earliest settlers of Augusta County, VA; Kitty's older brother Andrew was born i",
"2 CONC n Augusta county in 1759, so they arrived there from Pennsylvania sometime before that time.&amp;nbsp; They were in Pennsylvania, from Ireland, before 1752; her eldest sister, Jean Donnally, was born in Chester PA in 1752.&amp;nbsp; In Virginia, th",
"2 CONC ey settled in the area near the Cowpasture River, between Augusta and Bath Counties, which at the time was still wilderness, beyond the recognized settlement frontier, in Indian territory.&amp;nbsp; They were accompanied in their migration by othe",
"2 CONC r members of their families, the Donnallys and Gillespies, and many other Scotts-Irish immigrant families.&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;She married Rev. James Ward on 12 Jul 1800, in Bath County",
"2 CONC , Virginia (near where she was raised), who at the time was a circuit preacher for the Baltimore Conference of the Methodist Church, in the mountain sections of Virginia, including Augusta and Bath counties.&amp;nbsp; &lt;/span&gt;&lt;/p&gt;</line>",
"2 CONC <line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;In 1807 James Ward was transferred to the Western Conference, where he was stationed on the Lexington Circuit.&amp;nbsp; They resided on a farm in Jefferson county, Kentucky, which he had purcha",
"2 CONC sed, and where they raised their seven children.&lt;br&gt;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;Kitty died on 29 Aug, 1823, of unknown causes, and is buried in a family cemetery, on or near their old fa",
"2 CONC rm, on the outskirts of Louisville, KY.&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;/p&gt;</line></content></metadataxml>",
