"1 _META <metadataxml><content><line>&lt;p style=\"margin-: 0px; margin-bottom: 0px; font-size: 11px; line-height: normal; font-family: 'lucida grande';\"&gt;Floyd Co, KY, Deed Book E-161: Rutha Spears, wife of Thomas Spears, deceased, and all of the heirs o",
"2 CONC f Thomas Spears (Spencer Spears, Enoch Spears, William Spears, Nancy Auxier, Sintha Collins, Wiley Spears, Samuel Spears, Abraham Spears, and Fanny Spears, all of Johnson Co, and Joseph Franklin of Floyd Co) sold to William Gobble; $25 for 100 acre",
"2 CONC s [obtained] by virtue of a Kentucky land office warrant. (7/10/1843 was date admitted to office of Edwin Grimble; deed was dated only 1843)&lt;/p&gt;</line><line>&lt;p style=\"margin-: 0px; margin-bottom: 0px; font-size: 11px; line-height: normal",
"2 CONC ; font-family: 'lucida grande'; min-height: 13px;\"&gt;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p style=\"margin-: 0px; margin-bottom: 0px; font-size: 11px; line-height: normal; font-family: 'lucida grande';\"&gt;Floyd Co, KY, Deed Book F-170: The heirs o",
"2 CONC f Thomas and Ruth Spears relinquished claim for $1 to a section of land involving Singleton Flannery in a deed dated 5/18/1852. This land perhaps had been previously deeded to Singleton Flanary by Enoch Spears and others. The heirs named in the bod",
"2 CONC y of the deed were Enoch Spears, Cynthia Collins late Cynthia Spears, Christopher Collins, Wiley Spears Sr, Samuel Spears, Abraham Spears, Fanny Spears, Nancy Auxier and William Auxier, William Spears and Rutha Spears his widow. Also named were th",
"2 CONC e heirs of Spencer Spears deceased.&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-family: 'lucida grande'; font-size: 11px; line-height: normal;\"&gt;http://wc.rootsweb.ancestry.com/cgi-bin/igm.cgi?op=GET&amp;amp;db=marciamcclure&amp;amp;id=I8",
