"1 _OID 347e5907-5c91-43ae-b8e3-e3602ab863aa",
"1 DATE 1759-1787",
"1 PLAC Salisbury, Surry County, NC",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #f2e6cc;\"&gt;In the Store Accounts of John Nelms of Salisbury:1759-1787, Thomas Spear--a lame man--is listed for th",
"2 CONC e period 7 Sep 1764-1770. Thomas delivered 3 wooden cans in 1770, suggesting that he made them for John Nelms to sell, and thus was a cooper, or barrel maker. If he were crippled, this would be his likely occupation, say, rather than farming. It co",
"2 CONC uld also explain why, after coming to Surry County, he moved around quite a bit and didn't acquire any land until he was aged.&lt;/span&gt;&lt;/p&gt;</line><line>&lt;ul style=\"margin-: 0px; margin-bottom: 0px; padding-: 1em; font-family: arial, hel",
"2 CONC vetica, sans-serif; font-size: 12px; background-color: #f2e6cc;\"&gt;</line><line>&lt;li&gt;Notes by Charlie White:&lt;br&gt;&lt;br&gt;He was in a \"low state of health.\" To his wife Rebecca Speer he gave 140A, to be laid out as she chooses---squar",
"2 CONC e or oblong, including the \"menchen\" (mansion) house, plus the brown mare, feather bed, 2 cows &amp;amp; calves, 4 head sheep and 6 head of young cattle. To daughters Betsey, Nancy and Sally, a feather bed and cow, calf or heifers for each. Son Rob",
"2 CONC ert Speer received 50 acres adjoining his mother's west side; the two sons William Speer and Drury Speer received 100A, including the old place, to be equally divided. Sons Spence Speer, Eli Speer and Thomas Speer each received \"10 shillings and n",
"2 CONC o more\"---they had evidently left Surry. Son Reuben Speer was to receive Rebecca's 140 acres of land at her death. Trusty friends John Carter and Henry Speer were named executors.&lt;/li&gt;</line><line>&lt;/ul&gt;</line><line>&lt;p&gt;http://www.b",
"2 CONC ranches-n-twigs.com/genealogy/getperson.php?personID=I15654&amp;amp;tree=allfam&lt;/p&gt;</line></content></metadataxml>",
