"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-family: 'tahoma','sans-serif'; font-size: 10pt\"&gt;Further info in Clermont and Brown Counties on J. C. Ginnings&amp;nbsp;says:&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=\"font-family: 't",
"2 CONC ahoma','sans-serif'; font-size: 10pt\"&gt;&amp;nbsp;Fountain was starting out for New Orleans, but heard of Jackson&amp;#39;s victory in battle there and returned to VA. Says nothing further of his involvement in 1812 War. &lt;/span&gt;&lt;/p&gt;&lt",
"2 CONC ;p&gt;&lt;span style=\"font-family: 'tahoma','sans-serif'; font-size: 10pt\"&gt;It has not been substantiated that&amp;nbsp;Fountain died in or survived the 1812 war. Family rumor states that the filed a pension application in Campbell Co, KY. Prelim",
"2 CONC inary search on line shows no application however the actual National Archive records are only available on film. Further surch of the film records&amp;nbsp;is required to dispute or substantiate the family rumor.&lt;/span&gt;&lt;/p&gt;</line></con",
