"1 _DSCR excerpt from memorial   Created by: nancy robison  Record added: Jan 21, 2014   Find A Grave Memorial# 123857343",
"1 _META <metadataxml><content><line>&lt;p&gt;\"In the morning of October 16 in 1780,&amp;nbsp;a band of 300 Indians led by British troops raided farms near South Royalton, Vermont, stealing men and boys to sell for the bounty offered by the British. The Hen",
"2 CONC dee family had been warned, and the husband set off to warn others downstream. Hannah picked up her young daughter (Lucretia) and ran to the woods with her 7 year old son Michael. The Indians caught them and took Michael. When she demanded to kno",
"2 CONC w what they would do with the boy, one of the Indians who spoke English replied, \"make a soldier of him.\" As they dragged away her sobbing little boy, Hannah carried her screaming daughter toward the road and headed toward Lebanon, sixteen miles aw",
"2 CONC ay.&amp;nbsp;&lt;br&gt;She had not gone far when she was filled with a surge of uncommon resolve, a fierce determination. She returned upriver and found the British and the Indians gathering their captives....&lt;br&gt;Oblivious of the danger, sh",
"2 CONC e demanded her little boy. Capt. Horton said he could not control the Indians; it was none of his concern what they did. She threatened him. \"You are their Commander, and they must and will obey you. The curse will fall upon you for whatever crim",
"2 CONC e they commit, and all the innocent blood they shall shed will be found in your skirts when the secrets of men's hearts are made known, and it will cry for vengeance upon your head\".&amp;nbsp;&lt;br&gt;When her young son was brought in she took hi",
"2 CONC m by hand and refused to let go. An Indian threatened her with cutlass and jerked her son away. She defiantly took him back and said that she would never give up, they would not have her little boy.&amp;nbsp;&lt;br&gt;\"Finally, when the captives we",
"2 CONC re assembled for the long march to Canada, Mrs. Hendee somehow crossed the river with her daughter and nine small boys...Two of them she carried across. The others waded through the water with their arms around each other's necks, clinging to her s",
"2 CONC kirts. As the cold October night closed in, Mrs. Hendee huddled in the woods with the soaking-wet little brood she had rescued from certain death\".&amp;nbsp; &amp;nbsp;From History of Royalton, Vt, by Evelyn Wood Lovejoy&lt;br&gt;Children Hannah sa",
"2 CONC ved: Rufus Fish&lt;br&gt;&amp;nbsp;&lt;br&gt;Family links:&amp;nbsp;&lt;br&gt;&amp;nbsp;Parents:&lt;br&gt;&amp;nbsp;&amp;nbsp;William Hunter (1720 - 1782)&amp;nbsp;Daughter of William Hunter and Mary Larkin.&lt;br&gt;Wife of Robert Hendee (Handy)&l",
"2 CONC t;br&gt;Mother of Michael and Lucretia Hendee (Handy)&lt;br&gt;Hannah is said to have remarried to a Gideon Mosher and lived in New York.Burial:&lt;br&gt;Day District Cemetery&amp;nbsp;&lt;br&gt;Sharon&lt;br&gt;Windsor County&lt;br&gt;Vermont, USA&",
"2 CONC lt;/p&gt;</line></content></metadataxml>",
