"1 _META <metadataxml><content><line>&lt;p&gt;On 10 January or February 1661/2, Anna Bessey, Dorcas Bessey and Mary Bessey posted bond, promising &amp;quot;to appear at the Court to be holden at Plymouth the first Tuesday in March next, to answer for her un",
"2 CONC natural and cruel carriages towards George Barlow, [their] father-in-law&amp;quot;.&lt;/p&gt;&lt;p&gt;On 4 March 1661/2, &amp;quot;Anna Bessey, for her cruel and unnatural practices towards her father-in-law, George Barlow, in chopping of him in th",
"2 CONC e back, notwithstanding the odiousness of her fact, the Court, considering of some circumstances, viz:, her ingenious confession, together with her present condition, being with child, and some other particulars, have sentenced her to pay a fine o",
"2 CONC f ten pounds, or to be publicly whipped at some other convenient time when her condition will admit thereof&amp;quot;; &lt;/p&gt;&lt;p&gt;On 4 March 1661/2, &amp;quot;Dorcas Bessey and Mary Bessey, for carriages of like nature towards their father-",
"2 CONC in-law, though not in so high a degreee, were both sentenced to sit in the stocks during the pleasure of the Court, which accordingly was performed&amp;quot;; &amp;quot;the younger, viz:, Mary Bessey, was sharply reproved by the Court, as being b",
"2 CONC y her disobedience the occasioner of the evil abovementioned&amp;quot;; &lt;/p&gt;&lt;p&gt;On 4 March 1661/2,&amp;quot;G[e]org[e] Barlow and his wife were both severly reproved for their most ungodly living in contention with the other, and admonis",
"2 CONC hed to live otherwise&amp;quot;&lt;/p&gt;</line></content></metadataxml>",
