"2 CONC --------&lt;br&gt;The following was shared by Donald Lane Mar 2016:&lt;br&gt;&lt;br&gt;The Revolutionary War marker in the Pendleton Cemetery is a recognition marker placed there because there is no good proof for his grave location. He and his wif",
