"2 CONC tarted at present day Manville Rd near the Lane-Wisley Cemetery where John Wolfe was buried, and goes across Corbin Lane's farm.&lt;br&gt;&lt;br&gt;There is an old metal marker in the Vineyard Cemetery and some have said there is an old story tha",
"2 CONC t the marker once had the name \"Lane\" on it.&lt;br&gt;&lt;br&gt;I changed the year of birth for Corbin Lane to 1742 because he was on a 1763 tax list in Baltimore Co, MD (Pipe Creek in Delaware Hundred) with Samuel Lane Sr and Samuel Lane Jr. (\"S",
"2 CONC t Thomas Parish Registers 1732-1850,\" by Bill &amp;amp; Martha Reamy.) So he was born on or before 1742.&lt;br&gt;&lt;br&gt;Somewhere along the line there must have been an error in copying his date of death. His will was written on 8 Dec 1816, no",
"2 CONC t 1817. (Scott Co Will Book 1-88) In my records I show his death as Dec 1816 because he may have lived shortly after dictating his will. I do not have any record of when the will was proven.&lt;br&gt;&lt;br&gt;&amp;nbsp;&lt;br&gt;&amp;nbsp;&lt;br&g",
