"1 _META <metadataxml><content><line>&lt;p&gt;&lt;!--[if gte vml 1]&gt;&lt;v:shapetype</line><line> id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"</line><line> path=\"m@@4@@5l@@4@@11@@9@@11@@9@@5xe\" filled=\"f\" stroked=\"f\"&gt;</line><",
