"2 CONC f eqn=\"prod @@2 1 2\"/&gt;</line><line>  &lt;v:f eqn=\"prod @@3 21600 pixelWidth\"/&gt;</line><line>  &lt;v:f eqn=\"prod @@3 21600 pixelHeight\"/&gt;</line><line>  &lt;v:f eqn=\"sum @@0 0 1\"/&gt;</line><line>  &lt;v:f eqn=\"prod @@6 1 2\"/&gt;</line><line",
