"1 _OID 60bd0302-671e-4039-aea8-8ec545141e8a",
"1 _META <metadataxml><content><line>&lt;font face=\"Times New Roman\" size=\"3\"&gt;The Dutchman Creek Baptist Church  was formed in 1772 with ten members, among these ten were Thomas Estep  Jr. and Susannah Holmes Estep. Added by letter on November 22, 1772 w",
"2 CONC as  his mother Mary. On another record shows Thomas Estep Jr. was second on  the list at Eaton&amp;#39;s Baptist Meeting House among it&amp;#39;s members and died in  it&amp;#39;s arms. His mother was allowed to be kept up by charity.&lt;/font&gt",
"2 CONC ; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       It might be worthy to  note that his Great Grand-mother Elizabeth&amp;#39;s, that married his Great  Grand-father John Estop (Easthope) that lived in England last name was  Eaton. I&amp",
"2 CONC ;#39;m not sure it means anything or not.&lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       Both Thomas and his son  Isaac were prominent in this Church. Hannah McCannon, Thomas Jr&amp;#39;s  second wife was up for disorderl",
"2 CONC y conduct March 27, 1808, but was  excused. Apparently Eaton&amp;#39;s Meeting House was formed from Dutchman&amp;#39;s  Creek Church on December 16, 1790.&lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       The will of Thoma",
"2 CONC s  Estep Jr. was written April 30, 1805 and proved November 2, 1807. It was  recorded in Rowan County North Carolina Will Book G: 28. Names in the  will were: Hannah, (wife) married January 17, 1803, Isaac (son), Jacob  (son), Abraham (son), and Re",
"2 CONC becca (daughter).  Isaac, Jacob, and Abraham  were executors of the will. The widow dissented (the record says  descents) no evidence of an equity case. &lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       Notes:  May 6, 178",
"2 CONC 4  Thomas Estep Jr. was made overseer of the road from the Surry County  Line to Holman Road. (he was relieved May 4, 1785. This was a position  of responsibly on the frontier.&lt;/font&gt; &lt;br&gt; </line></content></metadataxml>",
