"1 _META <metadataxml><content><line>&amp;gt;JACOB SOWDER (1734?-1819)&lt;br&gt; &amp;gt;According to family tradition, our Souder line descended from Jacob Sowder,&lt;br&gt; &amp;gt;a native of Pennsylvania, who was a soldier in the Revolutionary War.&lt;b",
"2 CONC r&gt; &amp;gt;Nothing is known of his parents and it is not known for certain when and&lt;br&gt; &amp;gt;where he was born. Mr. Valentine Sowder, great grandson of Jacob Sowder,&lt;br&gt; &amp;gt;indicated in a letter&lt;br&gt; &amp;gt;dated 8 Apri",
"2 CONC l 1952, that he had a memorandum which stated that Jacob was&lt;br&gt; &amp;gt;born in Germany or Pennsylvania in 1734, but had no proof.  Valentine (age&lt;br&gt; &amp;gt;85 in 1952) was an attorney-at-law in Christianburg, VA, who did a great&lt;",
"2 CONC br&gt; &amp;gt;deal of research on Jacob Sowder.  Even with his research, we know very&lt;br&gt; &amp;gt;little about the first thirty years of Jacob&amp;#39;s live.&lt;br&gt; &amp;gt; &lt;br&gt; &lt;br&gt; &amp;gt;Land records verify that Jacob So",
"2 CONC wder moved to Montgomery Co, VA in the&lt;br&gt; &amp;gt;1770&amp;#39;s, where he resided while serving in the Continental Army in 1778-1779.&lt;br&gt; &amp;gt;On 27 July 1789, Jacob Sowder was granted 140 acres in Montgomery Co by&lt;br&gt; &amp;g",
"2 CONC t;Governor Beverly Randolph. Jacob sold this land to his son, Anthony Sowder,&lt;br&gt; &amp;gt;on 5 Dec 1815, in consideration of $1.00, described as containing 140 acres&lt;br&gt; &amp;gt;lying on the head of the Little River in Montgomery Co, VA",
"2 CONC , adjoining the&lt;br&gt; &amp;gt;lands of Wm. Aldridge and Stephen Lee.  This land became part of Floyd&lt;br&gt; &amp;gt;County in 1832. Valentine Sowder, grandson of Anthony Sowder, lived on this&lt;br&gt; &amp;gt;farm with his parents, Willia",
"2 CONC m &amp;amp; Mary Ann Thrash Sowder until 1890.&lt;br&gt; &amp;gt; &lt;br&gt; &amp;gt;&lt;br&gt; &amp;gt;According to family legend, Jacob Sowder and a neighbor decided to join the&lt;br&gt; &amp;gt;Continential Army, after becoming enraged by the B",
"2 CONC ritish Army&amp;#39;s trespassing&lt;br&gt; &amp;gt;on their land.  Jacob&amp;#39;s military records verify that he entered the service&lt;br&gt; &amp;gt;on 6 March 1778, and served in the 4th Virginia Regiment of Foot&lt;br&gt; &amp;gt;(Continenta",
"2 CONC l Line) as a private.  During the war, he was stationed at Valley&lt;br&gt; &amp;gt;Forge, PA, and White Plains, NY. Jacob was discharged on 16 Feb 1779 at&lt;br&gt; &amp;gt;Middlebrook, VA. He received six and two-thirds dollars a month for his&lt",
"2 CONC ;br&gt; &amp;gt;service in the army.  Valentine indicated in his 1952 letter that he had&lt;br&gt; &amp;gt;heard his mother, Mary Ann Thrash Sowder, say that his grandmother, Caty&lt;br&gt; &amp;gt;Snuffer Sowder, told her that she (Caty) had hear",
"2 CONC d Jacob Sowder say that he&lt;br&gt; &amp;gt;was a soldier in the Revoluntionary War.</line></content></metadataxml>",
