"1 _META <metadataxml><content><line>The first ancestor of which we have any knowledge was John Guthery of Greene &lt;br&gt;County, Pennsylvania. At the time he settled there it was a part of Virginia. &lt;br&gt;There was a dispute over the boundary line o",
"2 CONC f the two colonies; eventually &lt;br&gt;Pennsylvania won out but not until 1783. In order to get a better idea of John &lt;br&gt;Guthery&amp;#39;s whereabouts before, during and after the Revolution, let us have a &lt;br&gt;look at the complicate",
"2 CONC d changes that took place in Western &lt;br&gt;Pennsylvania.................Bedford County included Greene from 1771 until &lt;br&gt;1773, prior to which time Greene was part of Cumberland County (which was &lt;br&gt;established 27 January 1750) bu",
"2 CONC t little recognized as such.&lt;br&gt;Westmoreland &lt;br&gt;County was set up February 26th, 1773 and included Washington and Greene but all &lt;br&gt;west of the Monongahela clung to Virginia allegiance and was considered Augusta &lt;br&gt;County",
"2 CONC , Virginia until the line was run in 1779 and approved in 1783. (Take &lt;br&gt;careful note of this because it was on the west bank of the Monongahela that &lt;br&gt;John Guthery lived and he would naturally consider himself a &lt;br&gt;Virginian.",
"2 CONC )&lt;br&gt;Washington county was set up March 28th, 1781 and included Greene &lt;br&gt;County. Greene County was set up in 1796, February 9th.&lt;br&gt;It was in 1797 or &lt;br&gt;1798 that John Guthery emigrated to Ohio, so he could not have live",
"2 CONC d in Greene &lt;br&gt;County, Pennsylvania longer than a year or two. John Guthery&amp;#39;s address was &lt;br&gt;changed four times from 1771 to 1796 although he remained in the same &lt;br&gt;locality.&lt;br&gt;There was a Colonel John Guthrie o",
"2 CONC f Revolutionary fame living in &lt;br&gt;Westmoreland County, the county seat of which is Greensburgh, which we must not &lt;br&gt;confuse with our ancestor. It would be easy to do so as Laurence Guthrie in his &lt;br&gt;history of other branches o",
"2 CONC f Guthries in America has already done so. In this &lt;br&gt;case the activities of our John Guthery have been attributed to the Colonel &lt;br&gt;Guthrie of Westmoreland County, as well as his own achievements. This mistake &lt;br&gt;was very eas",
"2 CONC y to make, since our ancestor had only public records to his credit &lt;br&gt;with never a biographer. With Mr. Howard Leckey&amp;#39;s researches on the men of &lt;br&gt;Greene County we now know who and what our ancestor was. Another fact to puzz",
"2 CONC le &lt;br&gt;a genealogist was that the county seat of Greene County was once Greensburgh but &lt;br&gt;was changed to Greensboro to avoid confusion with the other Greensburgh, &lt;br&gt;Pennsylvania</line></content></metadataxml>",
