"1 _META <metadataxml><content><line>&lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       WILL OF THOMAS ESTEP JR.&lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       Rowan County, North Carolinia &lt;/font&gt; &lt;br&gt;&lt;fo",
"2 CONC nt face=\"Times New Roman\" size=\"3\"&gt;       Will Book &amp;quot;G&amp;#39; pg. 28:&lt;/font&gt; &lt;br&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       In the name of GOD,  amen, I Thomas Estep, of the county of Rowan in the stat",
"2 CONC e of North  Carolinia, being at the this time in a sound state of health both of  body and mind and calling to mind the morality of the body, and knowing  that it is appointed to all men once to die, I think proper to make this  my will, which is a",
"2 CONC s follows;&lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       First, I recommend my  soul to God, who gave it, and my body to be decently buried in the earth   - thinking that worldly estate it has pleased GOD to bless me wit",
"2 CONC h I  have and dispose of in manner and form as follows: to wit, my will is  that all my just debts be fully paid.  Then I lend to my beloved wife,  Hannah, my dwelling house with two beds and their furnishings, with all  Household furnishings, or a",
"2 CONC s may be required for her to keep house on,  also the use of my meadows and orchard with reasonable  support of my  plantation, with all my plantation utensils, also one horse creature of  which she has her&lt;/font&gt; &lt;font face=\"Times New Rom",
"2 CONC an\" size=\"3\"&gt;choice, also one side saddle,  also two cows with two young calves, six heads of hogs, these to have  her choice, three heads of sheep and all my stock of these are my  provisions, that may be on hand at the time of my decease; al",
"2 CONC l the above  mentioned articles, I only lend to my wife, while she remains my widow,  and my will is that she shall give security to my executors, which is  to be hereafter mentioned for delivery of all the above mentioned  articles, except such o",
"2 CONC f them as may have been made use of for her  support during her widowhood, at the expiration of this time the above  mentioned articles are to be delivered to my executors; and then to be  equally divided among my sons; ISAAC, JACOB, and ABRAHAM, a",
"2 CONC lso I give to  my daughter, REBECCA, ten pounds in money to be paid out of my estate  to her as she may need it, I also give four pounds to the Church at  Eaton Meeting House to be paid one pound a year to commence from the  profit to be paid int",
"2 CONC o the hands of the deacons or deacon; until it is  paid, and the rest of my estate both real and personal I give to my  three sons, ISAAC, JACOB, and ABRAHAM to be equally divided between  them. &lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roma",
"2 CONC n\" size=\"3\"&gt;       Jacob and Abraham  Easteb I leave and appoint to the sole executors of this my last will  and testament, which I acknowledge as such, I revoke all others.&lt;/font&gt; &lt;br&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=",
"2 CONC \"3\"&gt;       In witness hereof I do set my hand and fix my seal this day 30th day of April, A.D. Eighteen Hundred and five.&lt;/font&gt; &lt;br&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       Signed and acknowledged in the presenc",
"2 CONC es of John Hunt, Andrew Hunt and Henry Hunt.&lt;/font&gt; &lt;br&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;                        his mark&lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;              Thomas (T",
"2 CONC ) Easteb++++(Seal)&lt;/font&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;                          mark&lt;/font&gt; &lt;br&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       1807-Will of Thos Esteb entered for probate &a",
"2 CONC mp;amp; widow file descent.&lt;/font&gt; &lt;br&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;       Will on file at Rowan County Court House, Salisbury N.C.&lt;/font&gt; &lt;br&gt; &lt;br&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt",
"2 CONC ;       (Source: Gedcom received from Bill Wallace on 07 Sep 1997.)&lt;/font&gt; </line></content></metadataxml>",
