"1 _DSCR Thomas [1] Dexter was one of the Ten Proprietors of Sandwich and claimed his land there but did not remain.  He built the Grist Mill and turned it over to his son  Thomas [2] Dexter, who operated same.  Thomas left the Mill to his son John, however",
"2 CONC , he sold it and moved to Portsmouth, RI.  The site of the mill in Sandwich, MA has been restored to an operating Grist Mill and is remembered as \"Dexter Grist Mill\" to this day.",
