"1 _DSCR In the two years preceding our nations Bicentennial, the Franklin Mint issued a series of medallions commemorating the great women of the Revolutionary War era. Each one of the large, exquisitely -engraved, pewter medallions depict one of 36 specia",
"2 CONC l women who played an important role in our fight against Royalist forces. The Daughters of the American Revolution (DAR) commissioned the series of medallions and the Franklin Mint solicited subscribers to the series. Mintage was limited to less t",
"2 CONC han 1000 specimens, and as a result they can be difficult to locate today, some 40+ years later.    Each medallion is made of fine pewter and measures 45mm in diameter (almost 2 inches). The edge of each medallion is marked with the year of strikin",
"2 CONC g, the mintmark of the Franklin Mint on the edge of the medallion , and the composition.    Suburb set Issued by the Franklin Mint for the Daughters of the American Revolution. There are 36 of these fine pewter ingots in the collection. The Ingot",
"2 CONC s themselves have never been touched since being placed in the album. . The Ingots are large, at about 1.75 inches in diameter. A really wonderful collection for a young person a part of history not to be repeated by Franklin Mint. Rare to find com",
"2 CONC plete set",
