"1 _OID 89332b2c-aa66-4a4c-8122-707acc716462",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;&lt;strong&gt;Christian Gobble&amp;rsquo;s Declaration&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;State of Virginia",
"2 CONC , Washington County&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;On this 22&lt;sup&gt;nd&lt;/sup&gt; day of July 1833 personally appeared in open court before the justices of Washington county aforesaid now sit",
"2 CONC ting, Christian Gobble, and old and infirm soldier of the Revolution, who being first duly sworn according to law down, on his oath make the following declaration, in order to obtain the benefit of the act of Congress passed June of 1832.&lt;/span&",
"2 CONC gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;The said Christian Gobble stated his case as follows:&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;I am now in the seventy eighth year o",
"2 CONC f my age, but have no written account of my birth.&amp;nbsp; I was born in the State of Pennsylvania.&amp;nbsp; When I was very young my father removed to Baltimore county, Maryland.&amp;nbsp; Thereafter I do not remember but was told them by my pa",
"2 CONC rents.&amp;nbsp; From this latter place my father removed to Frederick county in the same State, where he died.&amp;nbsp; At this time I was an apprentice to a saddler.&amp;nbsp; The year New York was taken, which happened as I am told in 1776, I e",
"2 CONC nlisted for six months at Taneytown under Captain Jacob Good in the Regiment commanded by Col. Griffin of the Maryland troops, called the flying camp.&amp;nbsp; From my recollection of the time and circumstances I should have made my enlistment t",
"2 CONC o commence about the first of June &amp;ndash; but I am informed that my enrolment was on the 20&lt;sup&gt;th&lt;/sup&gt; day of July 1776 &amp;ndash; I was among the first who enlisted in the company . After the company was made up, we marched b",
"2 CONC y the way of Annapolis and Philadelphia to New York and arrived there before it was taken.&amp;nbsp; From New York we marched to Fort Washington.&amp;nbsp; From this fort the detachment to which I belonged marched to reinforce Gen. Wayne and were i",
"2 CONC n the battle of the White Plains. After this battle I marched under Captain Good of the Maryland troops to Fort Lee, marched from there from Fort Washington under Capt. Hardman, which was then attacked by the enemy and taken and I with others wer",
"2 CONC e made prisoners.&amp;nbsp; At this time I had served nearly four months.&amp;nbsp; I was taken to New York by the enemy and was confined in what was called the sugar house at least three months, and suffered greatly.&amp;nbsp; I was then liberate",
"2 CONC d from close confinement on parole, and my present recollect is that it was in the spring of the year when I was paroled.&amp;nbsp; I was now unable to walk from the sufferings I had endured in confinement and was carried from place to place unti",
"2 CONC l I reached home about twelve months afterwards and I was unable to perform labor for six or seven months after I got home.&amp;nbsp; I do not distinctly recollect the time I was exchanged, but it was after the last period above mentioned.&amp;nbsp",
"2 CONC ; After my exchange I obtained at Taneytown an honorable discharge from a Lieut whose name I think was Smith which is lost.&amp;nbsp; I therefore declare that from the time I enlisted unti I was released from confinement and paroled was at least se",
"2 CONC ven months &amp;ndash; from my parol until I reached home one year &amp;ndash; and from that time until I was discharged six months: - and during said service I was a private soldier.&amp;nbsp; I do not know that I can procure any further testimon",
"2 CONC y than what I exhibit from the Land office of Maryland as to my service nor is there living any clergyman in my neighborhood.&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;I heareby relinquish every claim whatso",
"2 CONC ever to a pension or annuity except the present and declare that my name is not on the pension roll of the agency of any State&amp;nbsp; &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-siz",
"2 CONC e: medium;\"&gt;Sworn to and subscribed the day and year aforesaid&amp;nbsp; (signature) Christian Gobble&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;(See attached original documents)&lt;/span&gt;&lt;/p&gt;</li",
"2 CONC ne></content></metadataxml>",
