"2 CONC x-sizing: border-box;\"&gt;Unknown&lt;/span&gt;&amp;nbsp;Convict:&amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;Unknown&lt;/span&gt;&lt;/div&gt;</line><line>&lt;div style=\"box-sizing: border-box; color: #754a10; font-family: 'times new roman'",
"2 CONC ; font-size: 16px; line-height: 28px;\"&gt;Port of Departure City:&amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;London&lt;/span&gt;&amp;nbsp;Nation:&amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;England&lt;/span&gt;&lt;/div&gt;</line>",
"2 CONC <line>&lt;div style=\"box-sizing: border-box; color: #754a10; font-family: 'times new roman'; font-size: 16px; line-height: 28px;\"&gt;Place of Arrival Colony:&amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;Maryland&lt;/span&gt;&amp;nbsp;Ship:&",
"2 CONC amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;Wren&lt;/span&gt;&lt;/div&gt;</line><line>&lt;div style=\"box-sizing: border-box; color: #754a10; font-family: 'times new roman'; font-size: 16px; line-height: 28px;\"&gt;Length of Indenture Year o",
"2 CONC f Indenture:&amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;about 1775&lt;/span&gt;&lt;/div&gt;</line><line>&lt;div style=\"box-sizing: border-box; color: #754a10; font-family: 'times new roman'; font-size: 16px; line-height: 28px;\"&gt;Place o",
"2 CONC f Indenture Colony:&amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;[Maryland]&lt;/span&gt;&lt;/div&gt;</line><line>&lt;div style=\"box-sizing: border-box; color: #754a10; font-family: 'times new roman'; font-size: 16px; line-height: 28px;\"&gt;",
"2 CONC </line><line>&lt;div style=\"box-sizing: border-box;\"&gt;Residence Nation:&amp;nbsp;&lt;span style=\"box-sizing: border-box;\"&gt;Ireland&lt;/span&gt;&lt;/div&gt;</line><line>&lt;/div&gt;</line><line>&lt;div style=\"box-sizing: border-box; color: #754a",
"2 CONC 10; font-family: 'times new roman'; font-size: 16px; line-height: 28px;\"&gt;Research Notes Source Citations:</line><line>&lt;p style=\"box-sizing: border-box; margin: 0px 0px 15px; line-height: 1.75;\"&gt;(1) Gerald Fothergill,&amp;nbsp;&lt;em style=",
"2 CONC \"box-sizing: border-box;\"&gt;Emigrants from England, 1773-1776&lt;/em&gt;&amp;nbsp;(Boston: New England Historic Genealogical Society, 1913), 126&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: border-box; margin: 0px 0px 15px; line-height: 1.75;\"&g",
"2 CONC t;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p style=\"box-sizing: border-box; margin: 0px 0px 15px; line-height: 1.75;\"&gt;&lt;span style=\"color: #000000; font-family: verdana, arial, helvetica; font-size: 13.3333px; line-height: normal; text-align: just",
"2 CONC ify;\"&gt;Indentured servants are typically defined as poor immigrants from England who, because they could not pay to come to the American colonies, contracted out their labor services for a period usually lasting about seven years in exchange fo",
"2 CONC r passage to the New World. Once they arrived, they initially worked for the master who brought them over and then received their freedom and a small plot of land at the end of their term of service. While this scenario undoubtedly played itself ou",
"2 CONC t in some cases, the reality for most indentured servants was quite different. First, the idea of an indenture, or a labor contract, was quite common in English tradition and was a part of English law. Second, Maryland&amp;rsquo;s early legislatur",
"2 CONC e created a series of laws addressing a range of issues related to indentured servitude which show that servants were not just poor white men, but children of both genders, as well as Africans. Additionally, indenture contracts were bought and sold",
"2 CONC , bartered, and litigated. Indentures were both a traditional means of securing work training, similar to an apprenticeship, and were a form of punishment. Lastly, terms of service could be until maturity if a child, seven years as typically descri",
"2 CONC bed, or any number of years that the master, the family, the courts, or the worker himself deemed appropriate or necessary. The Maryland colonial legislature, recognizing the need to develop a stable economy and labor force, acted numerous times t",
"2 CONC o codify the definitions and boundaries of indentured servant contracts. The series of laws clearly shows that they system was much more than simple seven year terms in exchange for free passage to the colony.&lt;/span&gt;&lt;/p&gt;</line><line>&lt",
"2 CONC ;/div&gt;</line></content></metadataxml>",
