"1 _META <metadataxml><content><line>&lt;p style=\"margin-: 0cm; margin-right: 0cm; margin-bottom: 0.0001pt; font-size: 11pt; font-family: calibri, sans-serif;\"&gt;Vermilion County, Illinois Deed Record II, Volume B page 150&lt;/p&gt;</line><line>&lt;p style",
"2 CONC =\"margin-: 0cm; margin-right: 0cm; margin-bottom: 0.0001pt; font-size: 11pt; font-family: calibri, sans-serif;\"&gt;This Indenture, made this twenty third day of May in the year of our Lord one thousand eight hundred and thirty two between John Sowd",
"2 CONC ers and Elizabeth Sowders his wife of the County of Vermilion, and State of Illinois, of the one part, and William Reed and Amos Williams of the County and State aforesaid of the other part.&lt;/p&gt;</line><line>&lt;p style=\"margin-: 0cm; margin-r",
"2 CONC ight: 0cm; margin-bottom: 0.0001pt; font-size: 11pt; font-family: calibri, sans-serif;\"&gt;Witnesseth that the said John Sowders and Elizabeth his wife for and in consideration of the sum of two hundred Dollars current money of the United States t",
"2 CONC o them in hand paid at and before the ensealing and delivery of these present, the receipt whereof is hereby acknowledged, have granted, bargained and sold; aliened, released, enfeoffed, conveyed and connfrimed, and by these present doth grant, bar",
"2 CONC gain and sell; alien, release, enfeoff, convey and confirm unto the said William Reed and Amos Williams and with their heirs and assigns, a certain tract or parcel of land with the appurtenances lying and being in the County of Vermilion, and Stat",
"2 CONC e of Illinois, to wit, half of the East half of the North East quarter of section one of township Nineteen North of Range Twelve West of the ........... and principal meridian, containing seventy-nine and ..... acres being the same more or less, an",
"2 CONC d all the estate, right, behoof, claim, interest and fee of them the said John Sowders and Elizabeth Sowders his wife, of, in and to the same, to have and to hold the said tract or parcel of land with all the appurtenances unto the said William Ree",
"2 CONC d and Amos Williams and to their heirs and assigns, to their only proper use and title forever.&lt;/p&gt;</line><line>&lt;p style=\"margin-: 0cm; margin-right: 0cm; margin-bottom: 0.0001pt; font-size: 11pt; font-family: calibri, sans-serif;\"&gt;An",
"2 CONC d the said John Sowders and Elizabeth Sowders his wife do covenant and agree with the said William Reed and Amos Williams and with their heirs and assigns, that they will and their heirs executors and administrators shall warrant and forever defen",
"2 CONC d the said tract or parcel of land, with all the appurtenances unto the said William Reed and Amos Williams and their heirs and assigns, all and every person or persons whatsoever, lawfully claiming or to claim the same. In Witness wereof the sai",
"2 CONC d John Sowders and Elizabeth Sowders his wife have hereunto set their hands and seals on the day and year first above written.&lt;/p&gt;</line><line>&lt;p style=\"margin-: 0cm; margin-right: 0cm; margin-bottom: 0.0001pt; font-size: 11pt; font-family",
"2 CONC : calibri, sans-serif;\"&gt;Sealed, signed and delivered in presence of:&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nb",
