"2 CONC t;p style=\"margin-: 0cm; margin-right: 0cm; margin-bottom: 0.0001pt; font-size: 11pt; font-family: calibri, sans-serif;\"&gt;State of Illinois, Vermilion County&lt;/p&gt;</line><line>&lt;p style=\"margin-: 0cm; margin-right: 0cm; margin-bottom: 0.000",
"2 CONC 1pt; font-size: 11pt; font-family: calibri, sans-serif;\"&gt;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p style=\"margin-: 0cm; margin-right: 0cm; margin-bottom: 0.0001pt; font-size: 11pt; font-family: calibri, sans-serif;\"&gt;I, Joseph Patterson, one of t",
"2 CONC he acting Justices of the Peace, in and for said County, do hereby certify that the above named John Sowders and Elizabeth Sowders his wife who were personally known to me to be the persons whose names are subscribed to the foregoing, Deed of Conve",
"2 CONC yance as having executed the same this day in their proper persons came before me and acknowledged that they severely signed, sealed and delivered the said Deed, for the uses and purposes therein mentioned. And the said Elizabeth Sowders being mad",
"2 CONC e fully acquainted with the contents of the above Deed, and by me examined separate and apart from her husband, acknowledged that she executed the said Deed and relinquished her dower to the lands and tenements therein mentioned, voluntarily, freel",
"2 CONC y and without compulsion of her said husband. Given under my hand and seal at Danville this 23rd day of May, A.D. 1832. Filed for record 17 July 1835 and recorded same day,&amp;nbsp; Joseph Patterson, J.P.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Am",
