"2 CONC p style=\"text-align: center;\" align=\"center\"&gt;&lt;span style=\"font-family: 'century gothic',sans-serif;\"&gt;Obituary &lt;br&gt;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-family: 'ce",
"2 CONC ntury gothic',sans-serif;\"&gt;Catherine Ward, consort of James Ward, died August 29 A.D. 1823 in the triumphs of faith, in full possession her right mind and with the pleasing prospect of a better country where the inhabitants shall never say the",
"2 CONC y are sick.&lt;span style=\"mso-spacerun: yes;\"&gt;&amp;nbsp; &lt;/span&gt;Thus ended her life and her sufferings here and she now soars above in the celestial fields of immortal glory, aged 52 years, 1 month, and 15 days, her spiritual age of 31 ye",
