"1 PLAC Washington Co., VA",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: small;\"&gt;&lt;span style=\"font-family: courier new;\"&gt;To get a prospective on where&amp;nbsp;Patrick COLLIN's land was located, go to: &lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;span styl",
"2 CONC e=\"font-family: Courier New;\"&gt;http://www.topozone.com/map.asp?lat=36.6525&amp;amp;lon=-81.8842&amp;amp;datum=nad27&amp;amp;u=4&amp;amp;layer=DRG&amp;amp;size=l&amp;amp;s=50&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=\"font-size",
"2 CONC : small;\"&gt;&lt;span style=\"font-family: courier new;\"&gt; to view a topographical map of the South Fork of the Holston River in the Alvarado area of Washington Co., VA.&lt;br&gt; Patrick's tract was located across the South Fork a ways east of Al",
"2 CONC varado in the Louse Creek area. &lt;br&gt;&lt;br&gt; William BRADSHAW ... 92 acres ... Treasury Warrant ... on a branch of the South Fork of the Holston River and on the north side of said fork ... Beginning corner to Robert MONTGOMERY's land ... t",
"2 CONC o Thomas EDMONDSON's land and ... Warrant #8136, dated February 2, 1782 ... Survey dated November 27, 1783. [WC Survey Book 1:218]. &lt;br&gt;&lt;br&gt; 05 Oct 1798 Deed -- from Wm. BRADSHAW &amp;amp; Elizabeth his wife to Patrick COLLIN, 92 acre",
"2 CONC s from Land Grant #8136 on the South Fork of the Holston River adjacent Robert MONTGOMERY and Thomas EDMONSON. &lt;br&gt; [WC DB 2:224-225]. &lt;br&gt;&lt;br&gt; Also of interest are the following surveys, land grants or deeds:&lt;br&gt;&lt;br&gt",
"2 CONC ; Survey Book 2:66-67 -- Andrew RUSSELL ... 860 acres ... 25 Feb 1796 / 30 Nov 1781 ... Survey dated 07 Jun 1798. &lt;br&gt; Bounds: WEIR, Thomas BERRY's 50 acre survey, Robert HUSTON [also HOUSTON], Jacob MILLER, Richard CONN, Patrick COLLIN, Robe",
"2 CONC rt NEELEY, James LOWREY, John GREENWAY, Thomas BERRY... &lt;br&gt; [also see: VA Land Grant Book 41:464-465].&lt;br&gt;&lt;br&gt; [Three sides of Wm. BRADSHAW's 92 acre Land Grant (N48E 120 poles, S70E 66 poles, and S27W 80 poles) are imbedded with",
"2 CONC in Andrew RUSSELL's 860 acre survey above. The 860 acre survey looks kind of like a long whale pointing in a southwest direction with its mouth wide open at the southwest end of the survey and the mouth would be gobbling up half of Patrick COLLIN'",
"2 CONC s 92 acre tract]. &lt;br&gt;&lt;br&gt; Land Grant dated 06 Jul 1818 for Thomas McSPADDEN and Robert EDMONDSON -- for 80 acres on both sides of the South Fork of the Holston River, in conformity with a Survey dated 28 Nov 1816, by virtue of a VA Lan",
"2 CONC d Office Treasury Warrant # 5315. [VA Land Grant Book 67:359-360, WC Survey Book 2:383]. &lt;br&gt;&lt;br&gt; [This 80 acre tract looks kind of like a large bladed hockey stick with the blade pointing in an easternly direction. Patrick COLLINS is a",
"2 CONC n adjoining neighbor north of the \"blade\" (in the center of the northern boundary of the \"blade\" is the following corner \"a white pine, 2 sourwoods and a dogwood on a clift near the river). James CAMPBELL is an adjoining neighbor on the south sid",
"2 CONC e of the \"blade\". On the west side of the \"hockey stick's handle, the adjacent neighbor was Wm. DUFF. The South Fork of the Holston River in the area on the above topographic map where Alvarado is located is where the \"handle\" was located and the \"",
"2 CONC blade\" was where the river turned from a westerly direction to a northwesterly direction towards Alvarado]. &lt;br&gt;&lt;br&gt; Deed dated 15 Jan 1827 -- from Thomas McSPADDEN and the heirs of Robert EDMONSON's (Polly G. EDMONDSON and Dorcas L. ED",
"2 CONC MONDSON) to John COLLINS, for $400.00, a tract of land containing 53 acres on the South Fork of the Holston River (this tract was the \"blade\" of the above \"hockey stick\"). [WC DB 9:322-323]. Robert CAMPBELL instead of James CAMPBELL is an adjoinin",
"2 CONC g neighbor on the south side of the \"blade\". &lt;br&gt;&lt;br&gt; Deed dated 18 Nov 1822 -- from Robert &amp;amp; Polly EDMONDSON to Thomas McSPADDEN, for $10.00, one half of a tract of land on the South Fork of the Holston River containing 22 acre",
"2 CONC s [WC DB 8:25-26]. This deed was for the upper or \"handle\" part of the above \"hockey stick\" tract that originally contained 80 acres. &lt;br&gt;&lt;br&gt; There is a plot map on the Berry website at:&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=\"",
"2 CONC font-family: Courier New;\"&gt;http://freepages.genealogy.rootsweb.com/~berry/newupload/figures/Fig22.html&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=\"font-size: small;\"&gt;&lt;span style=\"font-family: courier new;\"&gt; that contain",
"2 CONC s plots of many of the tracts south of Abingdon. Plot #30 in the corner of the southeastern section of the map where the Middle Fork of the Holston River flows into the South Fork of the Holston River was a 200 acre Land Grant dated 26 Jun 1786 fo",
"2 CONC r James GILLILAND [VA Land Grant Book Y:574-575]. Surrounding the eastern triangle section of GILLILAND's tract was a 234 acre Land Grant dated 21 Nov 1800 for Hugh NEELEY [VA Land Grant Book 46:551-552]. The eastern most corner of NEELEY's tract b",
"2 CONC ordered the upper most tip of the above 80 acre Land Grant dated 06 Jul 1818 for Thomas McSPADDEN and Robert EDMONDSON. &lt;br&gt; -------------------------------------------------- &lt;br&gt;&lt;br&gt; Bob Ford&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;<",
"2 CONC /line></content></metadataxml>",
