"2 CONC \" size=\"2\"&gt;UTHRIE&lt;/font&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;:&lt;br&gt;FROM &amp;quot;THE GUTHRIE FAMILY OF GREENE COUNTY,  PENNSYLVANIA&amp;quot; &lt;br&gt;BY MARY GRAY MAY &lt;br&gt;&lt;br&gt;The first ancestor of which we hav",
"2 CONC e  any knowledge was John Guthery of Greene County, Pennsylvania. At the time he  settled there it was a part of Virginia. There was a dispute over the boundary  line of the two colonies; eventually Pennsylvania won out but not until 1783. In  orde",
"2 CONC r to get a better idea of John Guthery&amp;#39;s whereabouts before, during and  after the Revolution, let us have a look at the complicated changes that took  place in Western Pennsylvania.................Bedford County included Greene  from 177",
"2 CONC 1 until 1773, prior to which time Greene was part of Cumberland County  (which was established 27 January 1750) but little recognized as such.  Westmoreland County was set up February 26th, 1773 and included Washington and  Greene but all west of t",
"2 CONC he Monongahela clung to Virginia allegiance and was  considered Augusta County, &lt;br&gt;Virginia until the line was run in 1779 and  approved in 1783. (Take careful note of this because it was on the west bank of  the Monongahela that John Guther",
"2 CONC y lived and he would naturally consider himself  a Virginian.) Washington county was set up March 28th, 1781 and included Greene  County. Greene County was set up in 1796, February 9th. It was in 1797 or 1798  that John Guthery emigrated to Ohio, s",
"2 CONC o he could not have lived in Greene  County, Pennsylvania longer than a year or two. John Guthery&amp;#39;s address was  changed four times form 1771 to 1796 although he remained in the same locality.  &lt;br&gt;There was a Colonel John Guthrie o",
