"2 CONC o his credit  with never a biographer. &lt;br&gt;With Mr. Howard Leckey&amp;#39;s researches on the men of  Greene County we now know &lt;br&gt;who and what our ancestor was. Another fact to  puzzle a genealogist was that the county seat of Green",
"2 CONC e County was once  Greensburgh but was changed to Greensboro to avoid confusion with the other  Greensburgh, Pennsylvania. &lt;br&gt;Mr. Leckey says there is so far as he has been  able to find out no connection with the Guthries of Westmoreland Co",
