"2 CONC e severe march into New Jersey. He lost his life  during this campaign. He left many descendants, some of whom still live in  Greene County. &lt;br&gt;The following account of John Guthery&amp;#39;s military career was  sent to Mrs. Carroll H. Ma",
"2 CONC y and is to be published in Mr. Leckey&amp;#39;s book on the  Ten Mile Country,vol. VIII-IX................John Guthery(Guthrie, Gutherie,  Guthrey, Gutrey) one of the prominent pioneer settlers on the Monongahela,  settled near the mouth of the Bi",
"2 CONC g Whiteley Creek before 1772, where his name is  found as an &amp;quot;inmate&amp;quot; or boarder in the Springhill Township, Bedford County tax  lists for 1772. According to his pension application made from Pike County,  Ohio, October 13, 1820",
