"2 CONC n on December 21st, 1778. (For a  complete record of this regiment see Pennsylvania Archives, Series V. vol. 3,  pp. 305-376.) &lt;br&gt;On his return to the Monongahela, John Guthery was elected  captain of a militia company from his district on B",
"2 CONC ig Whiteley Creek and  according to William Harrod Jr. in his interview with L. C. Draper, maintained  one of the protective forts of the section, named Guthery&amp;#39;s Fort or Fort  Guthery, which was located beside the Monongahela River near th",
"2 CONC e mouth of Big  Whiteley Creek and was occupied from 1776 to 1783. &lt;br&gt;The militia was the  Minute Men of the region. They were subject to call without previous notice and  many of them saw more rigorous service than the Continental regulars",
