"2 CONC t;br&gt;The  following account of the Baldwin family is taken from the Baldwin Genealogy by  Charles Candee Baldwin: &lt;br&gt;Tracing back from Lydia Baldwin&amp;#39;s father we have  Francis Baldwin Sr., who it is inferred was the grand-father o",
"2 CONC f Francis Baldwin  Jr., but the name of Francis Baldwin&amp;#39;s father has been lost. &lt;br&gt;Francis Baldwin  Sr. came over to America from England with his two brothers, Thomas and John.  They first settled, probably at Penn&amp;#39;s Neck wi",
"2 CONC th other English Baptist families,  according to Thomas Baldwin&amp;#39;s record, around 1653. &lt;br&gt;By family tradition and  fortified by a statement that Thomas was born in Oxfordshire, &lt;br&gt;England we may  justly conclude that this is t",
"2 CONC rue of Francis and John. Gilbert Cope thinks they  may have been connected with the Baldwins of Buckinghamshire, wealthy yeomen of  that county. &lt;br&gt;Francis Baldwin Sr. is found an early settler in the  neighborhood of West Chester County, Pe",
"2 CONC nnsylvania. At that time the locality was  in Delaware County, Pennsylvania. He was there as early as 1686. That he is the  brother of Thomas and John is evidenced by the will of John to sons of his  brother Francis, in which he leaves five shillin",
"2 CONC gs each to &amp;quot;all my brother  Francis&amp;#39; children&amp;quot;. The names of only two of these children are given in the  will and they inherited, besides, ten pounds. Their names were Thomas and John.  Which of these was the probable fat",
"2 CONC her of our Francis Jr. is not clear.  &lt;br&gt;Francis Sr.&amp;#39;s name appears in Chester County as witness to deeds in 1691,  1697, 1699 and 1700. In 1691 he received a deed of one hundred acres from Thomas  Coebourne, which lay in Chester. Th",
"2 CONC e consideration was an annuity. In 1692 John  Maddock conveyed fifty acres in Nether Providence, &amp;quot;Nether Cutt&amp;quot;, which he  purchased of Francis Baldwin. In 1695 he received a record deed from Thomas  Coebourne of one hundred acre",
"2 CONC s in Chester, which next year he conveyed to Joseph  Coebourne for fifty pounds. Letters of administration were granted August 17th,  1702 to his widow, Cicely, by the Register General at Philadelphia. Francis Sr.  was a miller. He was juror July 1",
"2 CONC 9th, 1700. He died in New Castle County in  1702. His wife was Cicely Coebourne, not Colbourne, as given in the Baldwin  history and afterward corrected. Cope says he does not know the names of Francis  Baldwin Jr.&amp;#39;s children. &lt;br&gt;Aga",
"2 CONC in we turn gratefully to Mr. Leckey who supplies  this loss of record of our family. They did go to Virginia. Mr. Leckey&amp;#39;s records  show that Francis Baldwin Jr. and his wife Charity (Harlan-Hackney) lived in  Chester County, Pennsylvania",
"2 CONC , the same locality as Francis Baldwin Sr. lived and  that in 1760 they moved to Franklin County Virginia (now Berkeley County, West  Virginia), where she and her second husband are buried in the Greene Springs  Meeting House Cemetery. &lt;br&gt;&l",
"2 CONC t;br&gt;&lt;font color=\"#0000c0\"&gt;Notes for&lt;/font&gt; Joseph  Hackney: &lt;br&gt;Joseph Hackney came from England to America with his parents and  settled in New Castle, &lt;br&gt;Delaware. He was married in Old Swedes Church in 1731  to Chari",
"2 CONC ty Harlan, daughter of Aaron &lt;br&gt;Harlan. Joseph Hackney died in 1745.  His widow, Charity Harlan Hackney was married in 1746 &lt;br&gt;to Francis Baldwin Jr.  In 1760 they moved to Frederick County, Virginia. The family were &lt;br&gt;Quaker",
"2 CONC s  and records can be found in Hinshaw and &amp;quot;Old Hopewell&amp;quot;. Haddon&amp;#39;s History of  Fayette &lt;br&gt;County, Pennsylvania, also gives part of the record. (From &amp;quot;The  History of Lieutenant-Colonel &lt;br&gt;John Guthe",
"2 CONC ry of Greene County Pennsylvania and  of Allied Families&amp;quot; Compiled by Mary Gray &lt;br&gt;May) . &lt;br&gt;&lt;/font&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;</line></content></metadataxml>",
