"1 _META <metadataxml><content><line>&lt;font face=\"Times, Times New Roman\" size=\"3\" color=\"#ffffff\"&gt;&lt;strong&gt;WILL OF  CORBIN LANE &lt;br&gt; &lt;font color=\"#999999\"&gt;&lt;br&gt;&lt;font color=\"#000000\"&gt;WILL BOOK 1 PAGE 88 SCOTT CO., VIRGINIA &",
"2 CONC lt;br&gt;&lt;br&gt;&lt;br&gt;I  Corbin Lane of SCOTT CO., the sate ofVirginia, do hereby make my last  written testement, in manner of form following, that is to say, first I  desire that all my debpts and funeral expences to be paid after my  dece",
"2 CONC ase. Should the principle part of my property prove sufficint for  the above proposal to settle payment of my debpts and the funneral  expences, I give to my lovely wife Frances Lane, one mare called Clase,  one cow and calf, also ten dollars in ca",
"2 CONC sh and all my household  furniture, and i also give to my son Abraham lane, my tract of land  which i now live on, which contains fifty acres, and i also give to my  son Samuel Lane all the ballance of my prpperty, at my decease. I  constitute an",
"2 CONC d make this sole execution of this my last will and  testement, and this to be my last will and testement given under my seal  this 8th day of Dec 1816. &lt;br&gt;Corbin Lane &lt;br&gt;&lt;br&gt;Witnesses, James  Davidson, Micheal Ellis, and Cather",
"2 CONC ine Williams &lt;br&gt;&lt;br&gt;(among the list  of his personal estate was - 1 Negro woman named Cuff - val. $20.00 &lt;br&gt;&lt;/font&gt;&lt;br&gt;compiled by J.N. adams 116 Regent Circle Oak Ridge, Tn, 1984 &lt;/font&gt;      &lt;/strong&gt;&l",
"2 CONC t;/font&gt;</line></content></metadataxml>",
