"2 CONC t-size: medium;\"&gt; join Washington&amp;rsquo;s Army at Quibbletown, New Jersey. This march, in mid winter, was a terrible ordeal and &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adju",
"2 CONC st: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; many men died from exposure. After taking part in the in the Battles of Brandywine and Germantown, the &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 't",
