"2 CONC -adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; Expedition against the Indians at Coshocton and on the Muskingum River. John Guthery had been made an &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/norma",
"2 CONC l 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; Ensign on December 21, 1778. (For Complete story of this Regiment see Penna. Archives Series Vol. 3. &lt;/span&gt;&lt;/p&gt;",
