"2 CONC aintained one of the protective forts in his section. He was the &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;",
"2 CONC \"&gt; captain of this company from 1780, until 1790, and then in 1793, was made a lieutenant colonel of the First &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretc",
"2 CONC h: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; Regiment of Washington County Militia in preparation for Wayne&amp;rsquo;s Campaign. From &amp;ldquo;Revolutionary &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times ne",
"2 CONC w roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; Soldiers Buried in Ohio&amp;rdquo; pp.167, we learn that John Guthery was born in Pennsylvania, April 14, 1744 &lt;/span&gt;&lt;/p&gt;<",
"2 CONC /line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; (although his pension claim of 1820 gives his age as 90 years old), and that he wa",
