"2 CONC ;\"&gt; Books, he left here about 1797 or 1798, and we have the story of his migration from the pen of his &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: norma",
"2 CONC l;\"&gt;&lt;span style=\"font-size: medium;\"&gt; daughter, Lydia (Guthery) Peters. She says that, &amp;ldquo;my parents with all their children except Francis, who &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'",
"2 CONC ; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; died in infancy, took their flat boat from Greensboro down the Monongahela to Pittsburgh, thence down the &lt;/span&gt;&lt;/p&gt;</line><line>&",
