"2 CONC ed the &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; Scioto River with our goods in a keel boat. Some o",
"2 CONC f the family road on horse back over a blazed trail, while &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt",
"2 CONC ; others followed on foot. We passed but one house the whole distance between the mouth of the Scioto and &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: norma",
"2 CONC l;\"&gt;&lt;span style=\"font-size: medium;\"&gt; where Piketon now stands. We camped there all night and next morning resumed our journey. Father had to &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px",
