"2 CONC : 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; depended a great part on the abundance of wild game to feed his large family.&amp;rdquo; From a history of Pik",
"2 CONC e &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; County we learn that his claim was several miles south o",
"2 CONC f Piketown, which he had caused to be laid out and &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size-adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; which h",
