"2 CONC ;span style=\"font-size: medium;\"&gt; Mound Cemetery on his own land. This source also says that he married on March 1, 1771, Lydia Baldwin. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'times new roman'; margin: 0px; font-size",
"2 CONC -adjust: none; font-stretch: normal;\"&gt;&lt;span style=\"font-size: medium;\"&gt; She was a daughter of Francis and Charity (Hackney-nee Harlan) Baldwin and the mother of twelve &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"font: 10px/normal 'tim",
