"1 _DSCR Post 1690 Chalfin America Immigration: Description of names, births, marriages, and other places the Chalfins' have left an impression",
"1 _META <metadataxml><content><line>&lt;span&gt;&lt;p&gt;First Generation: JOHN CHAFFIN &lt;/p&gt;&lt;p&gt;JOHN CHAFFIN, was born about 1670 in Bruton, Somerset, England. There record of&amp;nbsp;marriage or wife&amp;#39;s name has been found.&amp;nbsp;Joh",
"2 CONC n died 1745 in Southern Parish, Cumberland Dist. Virginia. He had two children, both sons: &lt;/p&gt;&lt;p&gt;1. Christopher Chaffin, born about 1690 in Christ Church Parish, Middlesex County, Virginia. &lt;/p&gt;&lt;p&gt;2. John Chaffin, was bor",
"2 CONC n about 1699 in Virginia and died 1773 in Cumberland County, Virginia. &lt;/p&gt;&lt;u&gt;&lt;font color=\"#800000\"&gt;&lt;p&gt;Second Generation: CHRISTOPHER CHAFFIN &lt;/p&gt;&lt;/font&gt;&lt;/u&gt;&lt;p&gt;CHRISTOPHER CHAFFIN, a farmer, was bor",
"2 CONC n about 1690 in Christ Church Parish, Middlesex County, Virginia. He married Sarah about 1710. They had five children: &lt;/p&gt;&lt;p&gt;1. John Chaffin, born April 01, 1716 in Middlesex County, Virginia; married Mary in 1740 in Virginia; died Jan",
"2 CONC uary 25, 1773 in Cumberland County, Virginia. &lt;/p&gt;&lt;p&gt;2. Christopher Chaffin, Junior, born November 11, 1718 in Middlesex County, Virginia; died August 22, 1727 in Christ Church Parish, Middlesex County, Virginia &lt;/p&gt;&lt;p&gt;3. Ma",
"2 CONC ry Chaffin, born September 02, 1721 in Middlesex County, Virginia &lt;/p&gt;&lt;p&gt;4. William Chaffin, born December 20, 1724 in Christ Church Parish, Middlesex County, Virginia; died January 03, 1724/25 in Christ Church Parish, Middlesex County",
"2 CONC , Virginia &lt;/p&gt;&lt;p&gt;5. John Chaffin, born July 27, 1726 in Middlesex County, Virginia. &lt;/p&gt;&lt;p&gt;Christopher was killed by two runaway slaves in 1727. His widow Sarah married John Davis on February 11, 1729/30. Sarah married Joh",
"2 CONC n Owen on July 20, 1732. &lt;/p&gt;&lt;u&gt;&lt;font color=\"#800000\"&gt;&lt;p&gt;Third Generation: JOHN CHAFFIN &lt;/p&gt;&lt;/font&gt;&lt;/u&gt;&lt;p&gt;JOHN CHAFFIN was born April 01, 1716 in Middlesex County, Virginia and died in Cumberland Coun",
"2 CONC ty, Virginia. He married Mary about 1740 in Virginia. John owned about 1300 acres of land in Goochland and Cumberland Counties, granted in patents from King George II of England through his representative William Gooch. John and Mary had nine child",
"2 CONC ren: &lt;/p&gt;&lt;p&gt;1. Hambo Chaffin, born 1740-1750 in Goochland or Cumberland County&lt;/p&gt;&lt;p&gt;2. Nathan Chaffin, born February 14, 1745/46 in Goochland or Cumberland County and married Elizabeth Watkins on November 28, 1768 in Cumber",
"2 CONC land County, Virginia. &lt;/p&gt;&lt;font color=\"#800000\"&gt;&lt;p&gt;Note! Nathan and his brother Joseph Chaffin owned an Ordinary (tavern/inn) in Powhatan County, Virginia. Powhatan County was formed from parts of Cumberland and Chesterfield Coun",
"2 CONC ties in 1777. &lt;/p&gt;&lt;/font&gt;&lt;p&gt;3. Rachel Chaffin, born 1740-1750 in Goochland or Cumberland County and married Robert Smith &lt;/p&gt;&lt;p&gt;4. Ruth Chaffin, born 1740-1750 in Goochland or Cumberland County and married Mr. Bradle",
"2 CONC y &lt;/p&gt;&lt;p&gt;5. Simon Chaffin, born 1740-1750 in Goochland or Cumberland County, married Agatha Curnutte and died in Kentucky &lt;/p&gt;&lt;p&gt;6. Miss Chaffin, born 1740-1760 in Goochland or Cumberland County and married Thomas Huckaby, S",
"2 CONC r. They had a son named Thomas Huckaby, Junior. She died before 1767 in Cumberland County, Virginia. &lt;/p&gt;&lt;p&gt;7. Joseph Chaffin, Revolutionary soldier, born 1741 in Cumberland County, Virginia and died June 22, 1815 in Bedford County, Vir",
"2 CONC ginia; married Nancy Ann Mitchell, daughter of James Mitchell, About 1767 in Cumberland County, Virginia.&lt;/p&gt;&lt;p&gt;8. Major Joshua Chaffin, Revolutionary soldier, born October 28, 1748 in Cumberland County, Virginia; married Elizabeth Este",
"2 CONC r Tinsley in 1769; married Patty Giles in 1800, daughter of Governor William B. Giles. Joshua died April 07, 1824 in Amelia County, Virginia. Their children included John Chaffin who married Elizabeth Booker, Tinsley Chaffin, Jimmy Chaffin who marr",
"2 CONC ied John Jeter, Nancy Chaffin who married Thompson Scott and Miss Chaffin who married a Mr. Ford. &lt;/p&gt;&lt;p&gt;9. Christopher S. Chaffin, born 1754-1757 in Cumberland County, Virginia. He died October 10, 1836 in Tazewell County, Virginia. &l",
"2 CONC t;/p&gt;&lt;u&gt;&lt;font color=\"#800000\"&gt;&lt;p&gt;Fourth Generation: CHRISTOPHER S. CHAFFIN &lt;/p&gt;&lt;/font&gt;&lt;/u&gt;&lt;p&gt;Christopher S. Chaffin, Revolutionary soldier, born 1754-1757 in Cumberland County, Virginia; married Mary An",
"2 CONC n Vawter on August 22, 1778; and died October 10, 1836 in Tazewell County, Virginia. Mary Ann was born October 1760 in Goochland County, Virginia and died in Felicity, Clermont County, Ohio. Their children were: &lt;/p&gt;&lt;p&gt;Tabitha Chaffin H",
"2 CONC arvey, born November 22, 1779 in Virginia. &lt;/p&gt;&lt;p&gt;Christopher Chaffin, born about 1780 in Cumberland County, Virginia. &lt;/p&gt;&lt;p&gt;They also had a son Stanley Chaffin, born 1781-1808. &lt;/p&gt;&lt;u&gt;&lt;font color=\"#800000\"&g",
"2 CONC t;&lt;p&gt;Fifth Generation: CHRISTOPHER CHAFFIN &lt;/p&gt;&lt;/font&gt;&lt;/u&gt;&lt;p&gt;Christopher Chaffin was born about 1780 in Cumberland County, Virginia and married Mary Roberts about 1802. She was born about 1782 in North Carolina. Christ",
"2 CONC opher and Mary had nine children: &lt;/p&gt;&lt;p&gt;1. Alafair Chaffin was born about 1806 in Floyd County, Kentucky &lt;/p&gt;&lt;p&gt;2. Stanley Chaffin was born 1810 in Floyd County, Kentucky &lt;/p&gt;&lt;p&gt;3. Joshua Chaffin was born abou",
"2 CONC t 1812 in Floyd County, Kentucky &lt;/p&gt;&lt;p&gt;4. Pleasant Chaffin was born 1815 in Kentucky &lt;/p&gt;&lt;p&gt;5. William Chaffin was born about 1818 &lt;/p&gt;&lt;p&gt;6. Nathan Chaffin was born 1820 in Kentucky &lt;/p&gt;&lt;p&gt;7. Elizabe",
"2 CONC th Betsy Chaffin was born 1825 in Virginia &lt;/p&gt;&lt;p&gt;8. Mary Ann Chaffin was born 1828 in Virginia &lt;/p&gt;&lt;p&gt;9. Nancy Chaffin was born about 1830 &lt;/p&gt;&lt;u&gt;&lt;p&gt;Click Here for Sixth Generation: NATHAN CHAFFIN &lt;/p&g",
"2 CONC t;&lt;/u&gt;&lt;font color=\"#800000\"&gt;&lt;p&gt;Of Interest! &lt;font size=\"2\"&gt;There is a place named Chaffin&amp;#39;s Bluff, southeast of Richmond, Virginia, that was the scene of several Civil War battles. It is located in a national park no",
