"1 _DSCR Biography of Wiley W. Young from History of Brown county",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"&gt;&lt;strong&gt;History of Brown County&lt;/strong&gt;&lt;strong&gt;http://www.heritagepursuit.com/Brown/Brown1883Index.htm&lt;/stro",
"2 CONC ng&gt;&lt;strong&gt;&lt;span style=\"color: black;\"&gt;HISTORY OF THE COUNTY ; ITS TOWNSHIPS, TOWNS, CHURCHES, SCHOOLS, ETC, ; GENERAL AND LOCAL STATISTICS; PORTRAITS OF EARLY SETTLERS AND PROMINENT MEN ; HISTORY OF THE NORTHWEST TERRITORY; HISTOR",
"2 CONC Y OF OHIO; MAP OF&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=\"color: black;\"&gt;BROWN COUNTY ; CONSTITUTION OF THE UNITED STATES, MISCELLANEOUS&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=\"color: black;\"&gt;MATTERS, ETC., E",
"2 CONC TC,&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=\"color: black;\"&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=\"color: black;\"&gt;ILLUSTRATED&lt;/span&gt;&lt;/strong&gt;&lt;span style=\"color: black;\"&gt;&amp;nbsp;",
"2 CONC &lt;/span&gt;&lt;strong&gt;&lt;span style=\"color: black;\"&gt;CHICAGO: W. H. BEERS &amp;amp; CO.&amp;nbsp; 1883.&lt;/span&gt;&lt;/strong&gt;http://www.heritagepursuit.com/Brown/Brown1883S2P50.htm&lt;strong&gt;Volume 1, pg 50&lt;/strong&gt;&lt;/span&",
"2 CONC gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: large;\"&gt;&lt;span style=\"font-family: 'times new roman';\"&gt;&lt;strong&gt;\"WILEY W. YOUNG&lt;/strong&gt;, lawyer, Georgetown, was born in Lewis Township, this county, May, 13, 1834. H",
"2 CONC is father, Omega Young, was a native of Tazewell County, in Southern West Virginia, where he was born in 1798. He came to Ohio in 1816, locating at Higginsport, Brown County. He subsequently learned the shoe-maker's trade at Cincinnati, and followe",
"2 CONC d that at Higginsport till 1830. He then removed to a farm in Lewis Township, where he still resides. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: large;\"&gt;&lt;span style=\"font-family: 'times new roman';\"&g",
"2 CONC t;At one time in his life, Mr. Young was a minister of the Christian denomination. &lt;/span&gt;&lt;span style=\"font-family: 'times new roman';\"&gt;Mr. Young's mother, was Nancy Stayton, a native of Lewis Township. She was the daughter of Jacob Sta",
"2 CONC yton (an Englishman by birth and a native of New Jersey) and Mary Wise, a cousin of Henry A. Wise, Governor of Virginia. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: large;\"&gt;&lt;span style=\"font-family: 't",
"2 CONC imes new roman';\"&gt;Our subject (Wiley W. Young) was the first son and fourth child of a family of fourteen children, eleven of whom are living. He was reared on the farm in Lewis Township, obtaining his early literary education in the district sc",
"2 CONC hool, and subsequently attending the High School, at Felicity, Clermont Co., Ohio. He was a farmer and a school teacher in early life. In 1856, he commenced the study of law at Georgetown, with Hanson L. Penn, Esq., remaining with him till his admi",
"2 CONC ttance to the bar, in 1858. He soon after opened an office in Georgetown, and has been in constant practice since. He was a law partner of Judge D. W. C. Loudon for ten or twelve years, and in 1879 formed a partnership with W. S. Whiteman. The fir",
"2 CONC m at once attained and enjoyed a successful law practice.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;span style=\"font-family: 'times new roman';\"&gt;In 1871, Mr. Young was admitted to practice in the Federal Courts, and has also practiced some in Kentu",
"2 CONC cky. His political views have been strongly Republican since the organization of that party. &lt;/span&gt;&lt;span style=\"font-family: 'times new roman';\"&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-family: 'time",
"2 CONC s new roman';\"&gt;Mr. Young was married, January 14, 1858, to &lt;strong&gt;Mary E. Grave&lt;/strong&gt;s, a native of Kanawha County, W Va.&amp;nbsp;&amp;nbsp; Six children have been given them, two living--Elizabeth and Wiley W., Jr.&amp;nbsp;&am",
"2 CONC p;nbsp; &lt;/span&gt;&lt;span style=\"font-family: 'times new roman';\"&gt;In 1847, Mr. Young accompanied his sister to Felicity, Clermont County, on a visit. While there be met his &amp;nbsp;&lt;strong&gt;great-grandmother&lt;/strong&gt;, Martha Cha",
"2 CONC ffant, who was then one hundred and six years of age (and lived fifteen months longer); &lt;strong&gt;his grandmother&lt;/strong&gt;, Tabitha Chaffante aged seventy-eight (and lived to be eighty-eight or eighty-nine years old); &lt;strong&gt;his au",
"2 CONC nt&lt;/strong&gt;, aged forty, who with himself and sister, represented four generations. &lt;/span&gt;&lt;span style=\"font-family: 'times new roman';\"&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=\"font-family: 'times new roman';\"&gt;Mr. Young's grandf",
"2 CONC ather, Fountain Young, was with Gen. Harrison, and suffered death at the battle of Thames in 1813.\" &amp;nbsp;--respectfully submitted GenResearch06&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</line></content></metadataxml>",
