"2 CONC ine><line>\tmso-style-noshow:yes;</line><line>\tmso-style-parent:\"\";</line><line>\tmso-padding-alt:0in 5.4pt 0in 5.4pt;</line><line>\tmso-para-margin:0in;</line><line>\tmso-para-margin-bottom:.0001pt;</line><line>\tmso-pagination:widow-orphan;</line><lin",
"2 CONC e>\tfont-size:12.0pt;</line><line>\tfont-family:\"Times New Roman\";</line><line>\tmso-ascii-font-family:Cambria;</line><line>\tmso-ascii-theme-font:minor-latin;</line><line>\tmso-hansi-font-family:Cambria;</line><line>\tmso-hansi-theme-font:minor-latin;}<",
"2 CONC /line><line>&lt;/style&gt;</line><line>&lt;![endif]--&gt; &lt;!--StartFragment--&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;strong&gt;Mary Spears, w/o Samuel Lane, was d/o Spencer Spears (Speer) who lived abt. 2 miles downstream from Samuel&amp;rsquo;",
"2 CONC s dad, Corbin Lane. &lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; Spencer also had a son Thomas Spears who married Samuel's sister, Ruth Lane. Mary Spears/Samuel Lane, Ruth Lane/Thomas Spears and Mar",
"2 CONC y &amp;amp; Thomas' dad, Spencer migrated to Floyd Co, KY between 1800 &amp;amp; 1810.&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;strong&gt;Source: genforum genealogy.com/spears 10/10/2000&lt;/strong&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;!-",
"2 CONC -EndFragment--&gt;&lt;/p&gt;</line></content></metadataxml>",
