"1 _OID bdadfb1b-b370-41fc-b7a0-a41efa7ed136",
"1 _DSCR Written by C. Byrd in response to email request by Ruth Lane and Thomas Spears descendent",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"color: #1f497d; font-family: 'calibri','sans-serif'; font-size: 11pt; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: 'times new roman'; mso-bidi-theme",
"2 CONC -font: minor-bidi; mso-themecolor: dark2;\"&gt;I can find three children on census for Ruth. Samuel, the son who was head of the house in 1850, 1860, born abt 1828; Abraham, who never married and lived with Samuel and then Samuel&amp;rsquo;s son, bo",
"2 CONC rn abt 1830; Frances J., a daughter born abt 1834. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"color: #1f497d; font-family: 'calibri','sans-serif'; font-size: 11pt; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-lat",
"2 CONC in; mso-bidi-font-family: 'times new roman'; mso-bidi-theme-font: minor-bidi; mso-themecolor: dark2;\"&gt;Thomas and Ruth were both born in Virginia and were in Floyd County, Kentucky by 1810. Thomas died between 1840 (on census) and 1850 (not on ce",
"2 CONC nsus). Ruth died between 1860 (on census) and 1870 (not on census) in Floyd County, Kentucky.&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"margin: 0in 0in 0pt;\"&gt;&lt;span style=\"color: #1f497d; font-family: 'calibri','sans-serif'; font-size: 1",
"2 CONC 1pt; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: 'times new roman'; mso-bidi-theme-font: minor-bidi; mso-themecolor: dark2;\"&gt;Ruth would have been 20 in 1810 and Thomas between 16 and 25. They alrea",
"2 CONC dy had two children (both sons) on the 1810 census and both Ruth and Thomas are listed as between 16 and 25 years old.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p style=\"margin: 0in 0in 0pt;\"&gt;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p style=\"",
