"1 _META <metadataxml><content><line>&lt;span style=\"font-size: small;\"&gt;Gen 1: Patrick Collins &lt;span style=\"font-size: small;\"&gt;(b.abt 1755 Ireland)&lt;/span&gt; &amp;amp; Elizabeth Pepper:&lt;/span&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size",
"2 CONC : small;\"&gt;Family tradition says that Patrick and his brothers were the first to come to America from Ireland, complete with a price on each head. How much of this is true remains to be seen. In the 17th and 18th centuries, England ruled Irelan",
"2 CONC d with a heavy hand. Pouching a rabbit on lands claimed by English gentry could bring a jail sentence, so a price on the head of an Irishman could have been anything. England often forced the Irish from their homes, pulling the houses down so the f",
"2 CONC amily who occupied the dwelling could not return. Perhaps Patrick and his family were indentured servants upon their arrival in America.&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: small;\"&gt;Patrick is said to have a bro",
"2 CONC ther, Michael. No record of Michael could be found in western Maryland, but across the river, in Virgina, we find a record of a Michael Collins who evidently lived in an area south of present day Winchester. It remains to be seen if this Michael wa",
"2 CONC s Patrick's brother.&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: small;\"&gt;It is a possibility that Elizabeth Pepper was Patrick's second wife and not the mother to the two children that we know are Patrick's offspring",
"2 CONC : Rhesa (or Reece) and Senah. They may have been more born to Patrick, but we have not been able to discern yet just who they are.&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: small;\"&gt;Patrick left Frederick Co. after th",
"2 CONC e 1790 census and made his way to Washington Co., Virgina. In 1798 Patrick purchased 92 acres of land on the south fork of the Holston River in Washington Co. It is assumed that by 1830 Patrick had died. He would have been getting on in years. He f",
"2 CONC ought in the Revolutionary war and was probably born around 1760, or before. So by 1830, Patrick would have been in his seventies, an old man by the standards of the day.&lt;/span&gt;&lt;/p&gt;</line></content></metadataxml>",
