"1 _OID e5624bcc-56c7-47b3-9d3a-569f1edf289f",
"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;Some people believe her parents to be Peter Callaway (1640-1715) &amp;amp; Elizabeth Johnson (1654-1739). I found a marriage record for a Peter Callowaye and Elyzabeth John",
"2 CONC son married in Somerset County, Maryland on March 26, 1677. Now this does seems to be more in line with date of birth of Jane born 1692. I believe many people have confused this Elyzabeth Johnson with another Elizabeth Johnson who immigrated with h",
"2 CONC er parents in 1635. This Elizabeth was two years old and she was born about 1633. This is a twenty-one year difference in ages. Again, people do not look at dates of births and deaths. They just add it on their tree. And then other people do the sa",
"2 CONC me. PEOPLE CHECK YOUR DATES!!! &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: 12.0pt;\"&",
"2 CONC gt;&lt;span style=\"font-size: medium;\"&gt;My conclusion is it is very possible Peter and Elyzabeth are Jane&amp;rsquo;s parents. I have not added them on to my tree, but I added this information to my personal records for Jane. I hope someday defin",
"2 CONC itive proof will be available to confirm they are her parents.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;</line></content></metadataxml>",
