"1 _META <metadataxml><content><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt; Frm \"EATON BAPTIST MEETING HOUSE\" Records, November 24, 1772 to April 25, 1818, original in Wake Forest College Library, Winston-Salem, N.C. &lt;/span&gt;&lt;/p&gt;</line>",
"2 CONC <line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt; Eaton Baptist Meeting House Records \"October the fifth ye 1772\" &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt; At the Constitution of the reagular Baptis",
"2 CONC t Church in North Carolina Roan County in the Forke of the Yadkin there was ten members. Their names are as followeth William Cook, the minister, James Tompkins, Ebenezer Fairchild, Abraham and Triphena Adams, Thomas Easteb, Susan Easteb, Savid Rea",
"2 CONC vis, Jeminma Reavis, Jesse Reavis. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt; There has been added sence Mary Easteb by letter November the 22 year 1772&lt;/span&gt;&lt;br&gt;&lt;span style=\"font-size: medi",
"2 CONC um;\"&gt; Elesabath Tompkins added by letter&lt;/span&gt;&lt;br&gt;&lt;span style=\"font-size: medium;\"&gt; Veara Bra added 1772 by letter&lt;/span&gt;&lt;br&gt;&lt;span style=\"font-size: medium;\"&gt; Benjamin Cutbeard added by baptism on the seavent",
"2 CONC h day of March 1772&lt;/span&gt;&lt;br&gt;&lt;span style=\"font-size: medium;\"&gt; fifteen members in the whole. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt; (1773) June the fifth at our quarterly meeting ther",
"2 CONC e was added by Baptism John Eaton and Elesabeth his wife&lt;/span&gt;&lt;br&gt;&lt;span style=\"font-size: medium;\"&gt; there was also added James Reavis and his wife by letter September the 17 (?) 1773&lt;/span&gt;&lt;br&gt;&lt;span style=\"font-siz",
"2 CONC e: medium;\"&gt; at a meeting held a Boons Ford on the Yadkins there was aded Nicholas White Hannah Lews Bathelem Canday Leah Garrawood nineteen in the whole. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt; Frm R",
"2 CONC OWAN COUNTY REGISTER pg 198 date unknown The Ed. herewith supplies a little background information. Eaton's Baptist Church, known as Dutchman Creek Baptist until 12 Dec. 1790, was organized 5 Oct. 1772, with the Rev. William Cook the first minister",
"2 CONC . Most of the membership was English, although there were many Germans in the area. A typed copy of the church minutes beg. 1773 is located in the Flossie Martin Room of the Davie County Library, 371 N. Main street, Mocksville, NC 27028. The churc",
"2 CONC h roll for 1787 lists 189 names including those of Abraham Adams, Jonathan Hunt, Ebenezer Fairchild, David Reavis, John Eaton, Georte Eaton, James Dial, Geo. Hedspeth, George Boone, Acquilla Green, Edward Moore, Abraham Hawkins, John Hunt, Andrew H",
"2 CONC unt, Thomas Eastep, Benjamin Cutbeard, Daniel Lewis, Edward Moore, Joseph Brandley, Elias Barnes, Silvester Baker, Joseph Whitley, Richard Cook. The church is situated in the northwestern quadrant of present day David County off hiway 601 on rura",
"2 CONC l road #1415. &lt;/span&gt;&lt;/p&gt;</line><line>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</line><line>&lt;p&gt;&lt;span style=\"font-size: medium;\"&gt;The above information was found at http://www.angelfire.com/fl3/reavisrevis/ReavisChurchRecords.html&amp;nbs",
"2 CONC p; Unfortunately, I was unable to contact the submitter of the information dixeebarb@@aol.com.&amp;nbsp; Please be sure to credit Dixee Barb for the information.&lt;/span&gt;&lt;/p&gt;</line></content></metadataxml>",
