"1 _META <metadataxml><content><line>&lt;p style=\"text-align: ;\"&gt;&lt;span style=\"font-family: comic sans ms,sans-serif; font-size: medium;\"&gt;&lt;span style=\"font-family: georgia; font-size: small;\"&gt;THOMAS ESTEP b: 3 Nov 1730 in St. Margaret's Parish",
"2 CONC , Anne Arundel, MD. He married a woman named Delilah, and they had the following children: Rachel b: 21 Dec 1759. He married a second time, to Susanna Holmes (b: 8 Feb 1741/42 in Frederick, MD) and had the following children: Honor b: ABT. 1760 i",
"2 CONC n Frederick, Md; Isaac b: 1762 in Frederick Co., Maryland; Mildred b: 1764 in Frederick, MD; Sarah b: 1772 in Frederick Co., Maryland; Rebecca b: 1774; Abraham b: 6 Dec 1776 in Rowan County NC; and Jacob Alexander b: 1779 in Rowan Co., N. Carolina",
"2 CONC . Marriage 3: Hannah McCannon (b: ABT. 1730 in Rowan, North Carolina) on 17 Jan 1803 in Rowan, North Carolina; Thomas died in 1807 in Rowan Co., North Carolina. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;</line></content></metadataxml>",
